a des API simples. Ce composant est le service web que vous pouvez appeler afin d\'obtenir vos données d\'analyse web en xml, json, php, csv, etc";s:21:"ReportingApiReference";s:32:"Référence de l\'API de rapports";s:14:"TopLinkTooltip";s:100:"Accédez à vos données de statistiques web depuis votre code via une API simple en JSON, XML, Etc.";s:18:"UserAuthentication";s:33:"Authentification de l\'utilisateur";s:8:"Glossary";s:9:"Glossaire";s:28:"LearnAboutCommonlyUsedTerms2";s:108:"Apprenez en plus sur les termes utilisés communément pour tirer le meilleur parti des statistiques Matomo.";s:19:"EvolutionMetricName";s:12:"%s Evolution";}s:7:"Actions";a:76:{s:24:"AvgGenerationTimeTooltip";s:58:"Moyenne basée sur %1$s entrée(s) %2$s entre %3$s et %4$s";s:16:"ColumnClickedURL";s:20:"Lien sortant cliqué";s:17:"ColumnClickedURLs";s:23:"Liens sortants cliqués";s:15:"ColumnActionURL";s:12:"URL d\'action";s:12:"ColumnClicks";s:5:"Clics";s:25:"ColumnClicksDocumentation";s:28:"Nombre de clics sur ce lien.";s:17:"ColumnDownloadURL";s:23:"URL de téléchargement";s:18:"ColumnDownloadURLs";s:21:"URL\'s téléchargées";s:20:"ColumnEntryPageTitle";s:26:"Titre de la page d\'entrée";s:18:"ColumnEntryPageURL";s:24:"URL de la page d\'entrée";s:19:"ColumnEntryPageURLs";s:23:"URL\'s de page d\'entrée";s:19:"ColumnExitPageTitle";s:26:"Titre de la page de sortie";s:17:"ColumnExitPageURL";s:24:"URL de la page de sortie";s:18:"ColumnExitPageURLs";s:23:"URL\'s de page de sortie";s:21:"ColumnNoResultKeyword";s:39:"Mots-clés sans résultats de recherche";s:14:"ColumnPageName";s:16:"Titre de la page";s:20:"ColumnPagesPerSearch";s:36:"Pages des résultats de la recherche";s:33:"ColumnPagesPerSearchDocumentation";s:200:"Les visiteurs vont effectuer des recherches sur votre site web et parfois cliquer sur "suivant" pour afficher plus de résultats. Ceci est le nombre moyen de pages de résultats vues pour ce mot-clé.";s:13:"ColumnPageURL";s:14:"URL de la page";s:20:"ColumnSearchCategory";s:23:"Catégorie de recherche";s:14:"ColumnSearches";s:10:"Recherches";s:27:"ColumnSearchesDocumentation";s:132:"Le nombre de visites pour lesquelles une recherche pour ce mot-clé a été effectuée avec le moteur de recherche de votre site web";s:17:"ColumnSearchExits";s:23:"%% sorties de recherche";s:30:"ColumnSearchExitsDocumentation";s:163:"Le pourcentage de visites où les utilisateurs ont quitté le site après avoir effectué une recherche pour ce mot-clé avec le moteur de recherche de votre site.";s:24:"ColumnSearchResultsCount";s:36:"Nombre de résultats de la recherche";s:24:"ColumnSiteSearchKeywords";s:17:"Mot-clés uniques";s:18:"ColumnUniqueClicks";s:13:"Clics uniques";s:31:"ColumnUniqueClicksDocumentation";s:155:"Nombre de visites qui ont impliqué un clic sur ce lien. Si un lien a été cliqué plusieurs fois en une seule visite, il n\'est compté qu\'une seule fois.";s:21:"ColumnUniqueDownloads";s:25:"Téléchargements uniques";s:20:"ColumnUniqueOutlinks";s:22:"Liens sortants uniques";s:16:"ColumnIdPageview";s:17:"ID de vue de page";s:25:"ColumnInteractionPosition";s:20:"Position de l\'action";s:14:"ActionsInVisit";s:20:"Actions de la visite";s:28:"DownloadsReportDocumentation";s:264:"Dans ce rapport vous pouvez voir quels fichiers les utilisateurs ont téléchargés. %s Ce que Matomo compte comme un téléchargement est un clic sur un lien de téléchargement. Le fait que le téléchargement ait été terminé ou non n\'est pas connu de Matomo.";s:29:"EntryPagesReportDocumentation";s:286:"Ce rapport contient des informations à propos des pages d\'entrées qui ont été utilisées durant la période spécifiée. Une page d\'entrée est la première page qu\'un utilisateur voit pendant sa visite. %s Les URLs des pages d\'entrée sont affichées dans une structure de dossier.";s:15:"EntryPageTitles";s:27:"Titres de la page d\'entrée";s:34:"EntryPageTitlesReportDocumentation";s:134:"Ce rapport contient des informations à propos des titres des pages d\'entrée qui ont été utilisées durant la période spécifiée.";s:28:"ExitPagesReportDocumentation";s:285:"Ce rapport contient des informations à propos des pages de sortie utilisées durant la période sélectionnée. Une page de sortie est la dernière page de la visite que l\'utilisateur voit avant de quitter le site. %s Les Urls de sorties sont affichées dans une structure de dossier.";s:14:"ExitPageTitles";s:27:"Titres de la page de sortie";s:33:"ExitPageTitlesReportDocumentation";s:133:"Ce rapport contient des infromations à propos des titres de pages de sortie qui ont été utilisées durant la période spécifiée.";s:9:"OneSearch";s:11:"1 recherche";s:20:"OutlinkDocumentation";s:102:"Un lien sortant est un lien qui mène le visiteur en dehors de votre site web (vers un autre domaine).";s:27:"OutlinksReportDocumentation";s:100:"Ce rapport affiche une liste hiérarchique de liens sortants sur lesquels ont cliqué vos visiteurs.";s:24:"PagesReportDocumentation";s:177:"Ce rapport contient des informations à propos des URLs qui ont été visitées. %s Le tableau est organisé hiérarchiquement, les URLs sont affichées en structure de dossier.";s:29:"PageTitlesReportDocumentation";s:212:"Ce rapport contient des informations à propos des titres des pages qui ont été visitées. %1$s Le titre de la page est la balise HTML %2$s que la plupart des navigateurs affichent dans le titre de la fenêtre.";s:8:"PageUrls";s:14:"URL de la page";s:18:"PageViewsByVisitor";s:88:"Nombre de fois où cette page a été vue par ce visiteur au cours de toutes ses visites";s:17:"PluginDescription";s:222:"Rapports à propos des vues et titres de pages. Vous permet de suivre l\'utilisation du moteur de recherche interne de votre site web. Trace automatiquement les clics sur des liens externes et téléchargements de fichiers.";s:14:"RevisitedPages";s:26:"Pages vues plus d\'une fois";s:21:"SiteSearchCategories1";s:129:"Ce rapport liste les catégories que les visiteurs ont sélectionnées lorsqu\'ils ont effectué une recherche sur votre site web.";s:21:"SiteSearchCategories2";s:184:"Par exemple, les sites d\'e-commerce ont généralement une sélection de la catégorie afin que les visiteurs puissent affiner leurs recherches aux produits d\'une catégories définie.";s:27:"SiteSearchFollowingPagesDoc";s:333:"Quand les visiteurs recherchent sur votre site web, ils sont à la recherche d\'une page, d\'un produit, d\'un contenu ou service en particulier. Ce rapport liste les pages qui ont été le plus cliquées après une recherche interne. En d\'autres termes, la liste des pages les plus recherchées par des visiteurs déjà sur votre site.";s:15:"SiteSearchIntro";s:407:"Effectuer un suivi des recherches que les visiteurs font sur votre site web est une manière très efficace d\'en apprendre plus sur ce que votre audience recherche, cela peut aider à trouver des idées pour du nouveau contenu, un nouveau produit e-commerce dont des clients potentiels pourraient être à la recherche, et de manière générale pour améliorer l\'expérience utilisateurs de votre site web.";s:18:"SiteSearchCategory";s:31:"Catégories (recherche du site)";s:20:"SiteSearchCategories";s:31:"Catégories (recherche du site)";s:17:"SiteSearchKeyword";s:28:"Mot-clé (recherche du site)";s:18:"SiteSearchKeywords";s:30:"Mots-clés (recherche du site)";s:31:"SiteSearchKeywordsDocumentation";s:83:"Ce rapport liste les mots-clés recherchés dans votre moteur de recherche interne.";s:39:"SiteSearchKeywordsNoResultDocumentation";s:245:"Ce rapport liste les mots-clés de recherche qui n\'ont retourné aucun résultat: peut-être est-il possible d\'améliorer l\'algorithme de recherche, ou peut-être que vos visiteurs cherchent du contenu qui n\'est pas (encore) sur votre site web ?";s:17:"SubmenuPagesEntry";s:15:"Pages d\'entrée";s:16:"SubmenuPagesExit";s:15:"Pages de sortie";s:17:"SubmenuPageTitles";s:16:"Titres des pages";s:17:"SubmenuSitesearch";s:21:"Recherche sur le site";s:21:"WidgetEntryPageTitles";s:25:"Titres de pages d\'entrée";s:20:"WidgetExitPageTitles";s:25:"Titres de pages de sortie";s:16:"WidgetPagesEntry";s:15:"Pages d\'entrée";s:15:"WidgetPagesExit";s:15:"Pages de sortie";s:16:"WidgetPageTitles";s:14:"Titres de page";s:31:"WidgetPageTitlesFollowingSearch";s:36:"Titre des pages après une recherche";s:29:"WidgetPageUrlsFollowingSearch";s:26:"Pages après une recherche";s:22:"WidgetSearchCategories";s:24:"Catégories de recherche";s:20:"WidgetSearchKeywords";s:33:"Mot-clés recherchés sur le site";s:28:"WidgetSearchNoResultKeywords";s:26:"Mots-clés sans résultats";s:10:"ActionType";s:13:"Type d\'action";s:11:"ActionTypes";s:14:"Types d\'action";s:9:"Behaviour";s:12:"Comportement";}s:11:"Annotations";a:18:{s:17:"AddAnnotationsFor";s:33:"Ajouter une annotation pour %s...";s:16:"AnnotationOnDate";s:26:"Annotation sur %1$s : %2$s";s:11:"Annotations";s:11:"Annotations";s:13:"ClickToDelete";s:41:"Cliquez ici pour supprimer une annotation";s:11:"ClickToEdit";s:41:"Cliquez ici pour supprimer une annotation";s:16:"ClickToEditOrAdd";s:56:"Cliquer pour éditer ou ajouter une nouvelle annotation.";s:19:"ClickToStarOrUnstar";s:64:"Cliquez pour marquer ou enlever le marquage de cette annotation.";s:19:"CreateNewAnnotation";s:38:"Cliquez-ici pour créer une annotation";s:19:"EnterAnnotationText";s:14:"Description...";s:18:"HideAnnotationsFor";s:34:"Masquer les annotations pour %s...";s:8:"IconDesc";s:40:"Voir les annotations pour cette période";s:17:"IconDescHideNotes";s:43:"Masquer les annotations pour cette période";s:15:"InlineQuickHelp";s:221:"Vous pouvez créer des annotations pour marquer des évènements spéciaux (comme un nouveau billet de blog ou une refonte du site web), pour garder une trace de vos analyses de données ou de ce que vous jugez important.";s:15:"LoginToAnnotate";s:42:"Identifiez-vous pour créer une annotation";s:13:"NoAnnotations";s:46:"Il n\'y a aucune annotation pour cette période";s:17:"PluginDescription";s:256:"Vous permet d\'annoter des dates pour marquer des changement sur votre site, noter des analyses que vous faites de vos données et partager vos notes avec vos collègues. En annotant vos données, vous pourrez vous rappeler pourquoi vos données sont ainsi.";s:21:"ViewAndAddAnnotations";s:42:"Voir et ajouter une annotation pour %s ...";s:23:"YouCannotModifyThisNote";s:142:"Vous ne pouvez pas modifier cette annotation parce que vous ne l\'avez pas créée ou vous n\'avez pas les accès d\'administrateur pour ce site.";}s:8:"Contents";a:16:{s:17:"PluginDescription";s:176:"Le suivi de contenu et de bannière vous permet de mesurer la performance (vues, clics, CTR) de chaque partie du contenu de vos pages (bannière de pub, image, tout élément).";s:11:"Impressions";s:11:"Impressions";s:17:"ContentImpression";s:20:"Affichage du contenu";s:18:"ContentInteraction";s:17:"Action du contenu";s:19:"ContentInteractions";s:18:"Actions du contenu";s:15:"InteractionRate";s:18:"Taux d\'interaction";s:11:"ContentName";s:14:"Nom du contenu";s:12:"ContentNames";s:15:"Noms du contenu";s:12:"ContentPiece";s:17:"Partie du contenu";s:13:"ContentPieces";s:19:"Portions de contenu";s:13:"ContentTarget";s:16:"Cible du contenu";s:14:"ContentTargets";s:17:"Cibles de contenu";s:8:"Contents";s:8:"Contenus";s:31:"InteractionsMetricDocumentation";s:115:"Nombre de fois où un bloc de contenu a subi une interaction (ex un click sur une bannière ou sur une publicité).";s:30:"ImpressionsMetricDocumentation";s:108:"Le nombre de fois qu\'un bloc de contenu tel qu\'une bannière ou une publicité a été affiché sur la page.";s:34:"InteractionRateMetricDocumentation";s:62:"Le ratio entre les impressions de contenu et les interactions.";}s:13:"CoreAdminHome";a:140:{s:17:"AddNewTrustedHost";s:36:"Ajouter un nouvel hôte de confiance";s:14:"Administration";s:14:"Administration";s:17:"ArchivingSettings";s:23:"Paramètres d\'archivage";s:16:"BrandingSettings";s:32:"Paramètres de l\'image de marque";s:29:"ErrorEmailFromAddressNotValid";s:41:"L\'adresse d\'origine SMTP n\'est pas valide";s:14:"ReleaseChannel";s:15:"Canal de sortie";s:16:"ClickHereToOptIn";s:42:"Cliquez ici pour inclure votre ordinateur.";s:17:"ClickHereToOptOut";s:42:"Cliquez ici pour exclure votre ordinateur.";s:11:"CorsDomains";s:45:"Domaines CORS (Cross-Origin Resource Sharing)";s:15:"CorsDomainsHelp";s:192:"Vous pouvez définir des noms de domaines ou sous-domaines tels que http://exemple.com ou http://stats.exemple.com. Pour autoriser les requêtes entre tous les domaines ajoutez simplement un *";s:22:"CustomLogoFeedbackInfo";s:216:"Si vous personnalisez le logo Matomo, vous pouvez être aussi vouloir cacher le lien %1$s du menu du haut. Pour ce faire, vous pouvez désactiver le plugin de Feedback dans la page de %2$sGestionnaire de Plugins%3$s.";s:18:"CustomLogoHelpText";s:117:"Vous pouvez personnaliser le logo Matomo qui sera affiché dans l\'interface utilisateur et les rapports par courriel.";s:18:"DevelopmentProcess";s:192:"Bien que nos processus de développement incluent des milliers de tests automatisés, les bêta-testeurs jouent un rôle clé dans l\'accomplissement de notre "politique zéro bug" pour Matomo.";s:19:"EmailServerSettings";s:27:"Paramètres du serveur mail";s:18:"ForBetaTestersOnly";s:34:"Pour les bêta testeurs uniquement";s:13:"ImageTracking";s:15:"Suivi par image";s:19:"ImageTrackingIntro1";s:159:"Quand un visiteur désactive JavaScript, ou quand JavaScript ne peut être utilisé, vous pouvez utiliser le lien de suivi par image pour suivre les visiteurs.";s:19:"ImageTrackingIntro2";s:203:"Générez le lien ci-dessous et copiez-collez le code HTML généré dans vos pages web. Si vous utilisez cela comme méthode de secours au suivi JavaScript, vous pouvez l\'insérer entre des balises%1$s.";s:19:"ImageTrackingIntro3";s:147:"Pour la liste complète des options que vous pouvez utiliser avec un lien de suivi par image, consultez la %1$sDocumentation de l\'API de suivi%2$s.";s:17:"ImageTrackingLink";s:23:"Lien de suivi par image";s:19:"ImportingServerLogs";s:31:"Importation des logs du serveur";s:23:"ImportingServerLogsDesc";s:219:"Une alternative au suivi des visiteurs via leur navigateur (par JavaScript ou par image) est d\'importer de manière continue les logs du serveur. Apprenez-en plus à propos des %1$sstatistiques via les logs serveur%2$s.";s:21:"InvalidPluginsWarning";s:95:"Les plugins suivants ne sont pas compatibles avec %1$s et ne peuvent pas être chargés : %2$s.";s:29:"InvalidPluginsYouCanUninstall";s:90:"Vous pouvez mettre à jour ou désinstaller ces plugins sur la page %1$sManagePlugins%2$s.";s:18:"JavaScriptTracking";s:20:"Suivi par JavaScript";s:15:"HttpTrackingApi";s:17:"API de suivi HTTP";s:26:"HttpTrackingApiDescription";s:282:"%1$sL\'API de suivi HTTP %2$svous permet de suivre ce que vous souhaitez. Elle peut être utile si vous utilisez un langage de programmation qui n\'a pas encore de SDK. Cela peut aussi être utile si vous souhaitez suivre des périphériques ou applications de manière particulière.";s:27:"JSTracking_CampaignKwdParam";s:37:"Paramètre de la campagne de mot-clé";s:28:"JSTracking_CampaignNameParam";s:29:"Paramètre nom de la campagne";s:36:"JSTracking_CodeNoteBeforeClosingHead";s:166:"Vérifiez que ce code est présent sur l\'ensemble des pages de votre site web. Nous vous recommandons de le placer immédiatement avant la balise de fermeture 1%1$s .";s:41:"JSTracking_CodeNoteBeforeClosingHeadEmail";s:192:"Assurez-vous que ce code est intégré dans un élément de script sur chaque page de votre site web. Nous vous conseillons de le coller juste avant la balise de fermeture des entêtes \'head\'.";s:35:"JSTracking_CustomCampaignQueryParam";s:93:"Utilisez des paramètres de requête personnalisés pour le nom et le mot-clé de la campagne";s:22:"JSTracking_CrossDomain";s:489:"Par défaut, l\'ID du visiteur qui identifie un visiteur unique est stocké dans les cookies de premier niveau ne peuvant uniquement être accédés par des pages du même domaine. Activer l\'association croisée des domaines vous permet de suivre toutes les actions et vues de pages d\'un visiteur spécifique sur plusieurs domaines. Quand un utilisateur clique sur le lien vers une des URL alias de votre site web, cela va ajouter un paramètre d\'URL pk_vid faisant suivre l\'ID du visiteur.";s:43:"JSTracking_CrossDomain_NeedsMultipleDomains";s:122:"Note : pour utiliser la liaison inter-domaine, vous devez spécifier plus qu\'un nom de domaine (URLs) pour votre site web.";s:39:"JSTracking_CustomCampaignQueryParamDesc";s:85:"Note : %1$sMatomo détectera automatiquement les paramètres de Google Analytics.%2$s";s:25:"JSTracking_DisableCookies";s:37:"Désactiver tous les cookies de suivi";s:29:"JSTracking_DisableCookiesDesc";s:147:"Désactive tous les cookies applicatifs. Les cookies existants de Matomo pour ce site web seront supprimés lors de la visite de la prochaine page.";s:35:"JSTracking_EnableCrossDomainLinking";s:42:"Active l\'association croisée des domaines";s:27:"JSTracking_EnableDoNotTrack";s:54:"Activer la détection côté client de "ne pas suivre"";s:42:"JSTracking_EnableDoNotTrack_AlreadyEnabled";s:119:"Note : Le support de la détection côté serveur de "ne pas suivre" est activé, cette option n\'aura donc aucun effet.";s:31:"JSTracking_EnableDoNotTrackDesc";s:100:"Donc les requêtes de suivi ne seront pas envoyées si les visiteurs ne souhaitent pas être suivis.";s:34:"JSTracking_GroupPageTitlesByDomain";s:62:"Préfixer le domaine du site au titre de la page lors du suivi";s:39:"JSTracking_GroupPageTitlesByDomainDesc1";s:198:"Si un internaute visite la page "À propos" sur blog.%1$s, la visite sera enregistrée en tant que "blog / À propos". C\'est la manière la plus facile d\'avoir un aperçu du trafic par sous-domaine.";s:23:"JSTracking_MergeAliases";s:97:"Dans le rapport des liens sortants, cacher les clics vers des alias d\'adresses connues telles que";s:27:"JSTracking_MergeAliasesDesc";s:89:"Ainsi un clic sur les adresses d\'alias (ex %s) ne sera pas compté comme un lien sortant.";s:26:"JSTracking_MergeSubdomains";s:50:"Suivre les visiteurs sur tous les sous-domaines de";s:30:"JSTracking_MergeSubdomainsDesc";s:90:"Ainsi si un visiteur visite %1$s et %2$s, cela sera comptabilisé comme une visite unique.";s:25:"JSTracking_PageCustomVars";s:64:"Suivre une variable personnalisée pour chaque affichage de page";s:29:"JSTracking_PageCustomVarsDesc";s:79:"Par exemple, avec une variable nommée "categorie" et la valeur "livre blancs".";s:24:"JSTracking_TrackNoScript";s:56:"Suivre les utilisateurs qui n\'ont pas activé JavaScript";s:28:"JSTracking_VisitorCustomVars";s:65:"Effectuer le suivi des variables personnalisées pour ce visiteur";s:32:"JSTracking_VisitorCustomVarsDesc";s:68:"Par exemple, avec une variable nommée "type" et la valeur "client".";s:18:"JSTracking_EndNote";s:115:"Note : vous pouvez générer un code de suivi personnalisé dans la section d\'administration %1$sCode de suivi%2$s.";s:16:"JSTrackingIntro1";s:282:"Vous pouvez suivre les visiteurs de votre site web de différentes manières. La méthode recommandée est de le faire via JavaScript. Pour utiliser cette méthode, vous devez vous assurer que chaque page de votre site web contient du code JavaScript; que vous pouvez générer ici.";s:16:"JSTrackingIntro2";s:158:"Une fois que vous avez le code de suivi JavaScript pour votre site web, copiez-collez le sur toutes les pages dont vous voulez effectuer le suivi avec Matomo.";s:17:"JSTrackingIntro3a";s:196:"Dans la plupart des sites web, blogs, CMS, etc. vous pouvez utiliser un plugin pour faire le travail technique à votre place (voir notre %1$sliste de plugins existants pour intégrer Matomo%2$s).";s:17:"JSTrackingIntro3b";s:234:"Si aucun plugin n\'existe, vous pouvez éditer les modèles de votre site web et ajouter le code de suivi JavaScript juste avant la balise &lt;/head&gt ; qui est souvent définie dans un fichier \'header.php\', \'header.tpl\' ou similaire.";s:16:"JSTrackingIntro4";s:140:"Si vous ne souhaitez pas utiliser JavaScript pour effectuer le suivi des visiteurs, %1$sgénérez un lien de suivi par image ci-dessous%2$s.";s:16:"JSTrackingIntro5";s:362:"Si vous voulez faire plus qu\'effectuer le suivi des visites de pages, veuillez consulter %1$sla documentation Matomo JavaScript Tracking%2$s pour connaître la liste des fonctions disponibles. En utilisant ces fonctions vous pouvez effectuer le suivi des objectifs, variables personnalisées, commandes de e-commerce, chariots/paniers abandonnés et plus encore.";s:27:"LogoNotWriteableInstruction";s:212:"Afin d\'utiliser votre logo personnalité au lieu du logo par défaut Matomo, ajoutez des permissions à ce répertoire : %1$s Matomo a besoin d\'un accès en écriture à vos logos stockés dans les fichiers %2$s.";s:18:"FileUploadDisabled";s:186:"Le téléversement de fichiers n\'est pas activé dans votre configuration PHP. Pour téléverser un logo personnalisé veuillez définir %s dans php.ini et redémarrer votre serveur web.";s:16:"LogoUploadFailed";s:110:"Le fichier téléversé n\'a pas pu être pris en compte. Veuillez vérifier que le fichier a un format valide.";s:10:"LogoUpload";s:38:"Sélectionnez le logo à télécharger";s:13:"FaviconUpload";s:41:"Sélectionnez un favicon à télécharger";s:14:"LogoUploadHelp";s:109:"Veuillez télécharger un fichier dans un des formats suivants %1$s avec une hauteur minimale de %2$s pixels.";s:14:"MenuDiagnostic";s:10:"Diagnostic";s:19:"MenuGeneralSettings";s:22:"Paramètres généraux";s:10:"MenuSystem";s:8:"Système";s:15:"MenuDevelopment";s:14:"Développement";s:15:"MenuMeasurables";s:21:"Éléments mesurables";s:14:"OptOutComplete";s:116:"Cookie d\'exclusion installé. Vos visites sur ce site web ne seront PAS enregistrées par notre outil d\'analyse web.";s:17:"OptOutCompleteBis";s:192:"Note : si vous nettoyez vos cookies et supprimez le cookie d\'exclusion, ou bien si vous changez d\'ordinateur et/ou de navigateur, il vous faudra de nouveau effectuer la procédure d\'exclusion.";s:14:"OptOutDntFound";s:240:"Vous n\'êtes pas suivi parce que votre navigateur transmet que vous ne voulez pas l\'être. Ceci est un paramètre de votre navigateur et vous ne serez pas en mesure de participer avant d\'avoir désactivé la fonctionnalité "ne pas suivre".";s:17:"OptOutExplanation";s:297:"Matomo met un point d\'honneur à respecter la vie privée sur Internet. Pour fournir à vos visiteurs le choix de ne pas apparaître dans les analyses de Matomo, vous pouvez ajouter le code HTML suivant sur une des pages de votre site web, par exemple dans la page "Politique de confidentialité".";s:22:"OptOutExplanationIntro";s:250:"Ce code affichera un IFrame contenant un lien permettant à vos visiteurs de désactiver le suivi Matomo en installant un cookie dans leur navigateur. Voir ci-dessous (ou %1$scliquez ici %2$s) pour afficher le contenu qui sera affiché dans l\'IFrame.";s:21:"OptOutForYourVisitors";s:38:"Exclusion de Matomo pour vos visiteurs";s:18:"PiwikIsInstalledAt";s:33:"Matomo est installé à l\'adresse";s:22:"PersonalPluginSettings";s:32:"Paramètres personnel de plugins";s:29:"PluginSettingChangeNotAllowed";s:89:"Vous n\'êtes pas autorisé(e) à modifier la valeur du paramètre "%1$s" du plugin "%2$s"";s:27:"PluginSettingReadNotAllowed";s:90:"Vous n\'êtes pas autorisé(e) à voir la valeur du paramètre "%1$s" dans le plugin "%2$s"";s:14:"PluginSettings";s:23:"Paramètres des plugins";s:19:"PluginSettingsIntro";s:80:"Vous pouvez ici modifier les paramètres des composants tierce partie suivants :";s:29:"PluginSettingsValueNotAllowed";s:72:"La valeur pour le champ "%1$s" du composant "%2$s" n\'est pas autorisée.";s:24:"PluginSettingsSaveFailed";s:47:"Erreur lors de l\'enregistrement des paramètres";s:25:"PluginSettingsSaveSuccess";s:35:"Paramètres du plugins mis à jour.";s:16:"TrackingFailures";s:16:"Erreurs de suivi";s:19:"SettingsSaveSuccess";s:24:"Paramètres mis à jour.";s:29:"SendPluginUpdateCommunication";s:73:"Envoyer un courriel lorsqu\'une mise à jour d\'un composant est disponible";s:33:"SendPluginUpdateCommunicationHelp";s:101:"Un courriel sera envoyé aux super utilisateurs quand une nouvelle version de plugin sera disponible.";s:14:"StableReleases";s:235:"Si Matomo représente une part critique de vos affaires, nous vous recommandons d\'utiliser la dernière version stable. Si vous utilisez la dernière version et que vous trouverez un bug ou avez une suggestion, %1$scliquez ici%2$s svp.";s:11:"LtsReleases";s:95:"Les versions LTS (Long Term Support) ne reçoivent que des correctifs de sécurité et de bugs.";s:20:"SystemPluginSettings";s:31:"Paramètres système de plugins";s:10:"TrackAGoal";s:32:"Effectuer le suivi d\'un objectif";s:12:"TrackingCode";s:13:"Code de suivi";s:17:"TrackingCodeIntro";s:170:"Matomo vous permet d\'intégrer le code de suivi dans votre site web, application mobile ou même pour n\'importe quel périphérique ou application de plusieurs manières.";s:18:"TrustedHostConfirm";s:61:"Êtes-vous sûr(e) de vouloir changer le nom d\'hote autorisé";s:19:"TrustedHostSettings";s:11:"Nom d\'hôte";s:6:"UiDemo";s:26:"Demo interface utilisateur";s:14:"UpdateSettings";s:27:"Paramètres de mise à jour";s:13:"UseCustomLogo";s:30:"Utiliser un logo personnalisé";s:18:"ValidPiwikHostname";s:25:"Nom d\'hôte Matomo valide";s:19:"WithOptionalRevenue";s:19:"avec revenu optimal";s:14:"YouAreOptedOut";s:39:"Vous n\'êtes actuellement pas suivi(e).";s:17:"YouAreNotOptedOut";s:26:"Vous n\'êtes pas exclu(e).";s:12:"YouMayOptOut";s:214:"Vous pouvez choisir ici de NE PAS autoriser le suivi de votre ordinateur via un cookie lui assignant un numéro d\'identification unique. Notre outil d\'analyse web n\'enregistrera pas l\'activité de votre ordinateur.";s:15:"YouMayOptOutBis";s:84:"Pour faire ce choix et installer un cookie d\'exclusion, veuillez cliquer ci-dessous.";s:12:"OptingYouOut";s:47:"Désinscription en cours, merci de patienter...";s:28:"ProtocolNotDetectedCorrectly";s:113:"Vous visualisez actuellement Matomo n\'est pas parvenu à détecter une connexion non sécurisée pour le serveur.";s:36:"ProtocolNotDetectedCorrectlySolution";s:285:"Afin de vous assurer que Matomo demande et sever votre contenu de manière sécurisée au travers du protocole HTTPS, vous devriez éditer votre fichier %1$s et configuration vos paramètres de proxy ou bien vous pouvez ajouter la ligne %2$s sous la section %3$s %4$sEn savoir plus%5$s";s:13:"YouMayOptOut2";s:70:"Vous pouvez vous opposer au suivi de votre navigation sur ce site web.";s:13:"YouMayOptOut3";s:182:"Cela protégera votre vie privée, mais empêchera également le propriétaire d\'apprendre de vos actions et de créer une meilleure expérience pour vous et les autres utilisateurs.";s:15:"UncheckToOptOut";s:41:"Décochez cette case pour être exclu(e).";s:12:"CheckToOptIn";s:46:"Cochez cette case pour ne plus être exclu(e).";s:20:"OptOutErrorNoCookies";s:91:"La fonctionnalité de désactivation du suivi nécessite que les cookies soient autorisés.";s:19:"OptOutErrorNotHttps";s:207:"La fonctionnalité de désactivation du suivi pourrait ne pas fonctionner car ce site n\'a pas été chargé en HTTPS. Veuillez recharger la page pour vérifier que le statut de ce suivi a bien été changé.";s:21:"OptOutErrorWindowOpen";s:210:"La fonctionnalité de désactivation du suivi pourrait ne pas marcher car il semble que la popup de désactivation a été bloquée. Veuillez recharger la page pour vérifier que le statut a bien été changé.";s:31:"MissingTrackingCodeEmailSubject";s:83:"Aucun trafic enregistré dans les statistiques Matomo pour %s, démarrez maintenant";s:27:"JsTrackingCodeMissingEmail1";s:178:"Il y a quelques jours vous avez ajouté le site web \'%s\' à votre Matomo. Nous venons de vérifier et il semble que votre Matomo n\'aie pas enregistré de trafic pour ce site web.";s:27:"JsTrackingCodeMissingEmail2";s:250:"Pour commencer à suivre les données et obtenir des informations sur vos utilisateurs, vous devez configurer le suivi sur votre site Web ou votre application mobile. Pour les sites Web, intégrez simplement le code de suivi juste avant la balise %s.";s:27:"JsTrackingCodeMissingEmail3";s:145:"Afin de trouver et de personnaliser votre code de suivi, %1$scli