devriez le désinstaller.";s:17:"PluginRequirement";s:19:"%1$s requiert %2$s.";s:17:"PluginsManagement";s:23:"Gestionnaire de plugins";s:15:"NotDownloadable";s:20:"Non téléchargeable";s:21:"PluginNotDownloadable";s:40:"Ce composant n\'est pas téléchargeable.";s:31:"PluginNotDownloadablePaidReason";s:73:"Certaines des raisons peuvent être une licence expirée ou insuffisante.";s:22:"PluginRequiresInternet";s:188:"Ce composant requiert une connexion internet fonctionnelle. Veuillez vérifier la valeur `enable_internet_features` de votre configuration si vous souhaitez utiliser cette fonctionnalité.";s:15:"PluginActivated";s:17:"Composant activé";s:6:"Status";s:5:"État";s:21:"SuccessfullyActicated";s:51:"Vous avez activé avec succès <strong>%s</strong>.";s:17:"TeaserExtendPiwik";s:62:"Etendre Matomo avec des composants additionnels et des thèmes";s:25:"TeaserExtendPiwikByPlugin";s:130:"Enrichissez Matomo en %1$sinstallant des composants depuis le marché%2$s ou %3$sen téléversant un composant au format .zip%4$s.";s:24:"TeaserExtendPiwikByTheme";s:81:"Profitez d\'une nouvelle charte graphique en %1$sinstallant un nouveau thème%2$s.";s:41:"InstallingNewPluginViaMarketplaceOrUpload";s:115:"Vous pouvez installer automatiquement un plugin à partir du Marketplace ou %1$supload a plugin%2$s au format .zip.";s:27:"TagManagerNowAvailableTitle";s:59:"Le Gestionnaire de balises Matomo est désormais disponible";s:30:"TagManagerNowAvailableSubtitle";s:153:"Gérer toutes vos balises facilement depuis une seule plateforme afin d\'obtenir les informations dont vous avez besoin, les possibilités sont infinies !";s:21:"ActivateTagManagerNow";s:45:"Activer le gestionnaire de balises maintenant";s:34:"TagManagerEmailSuperUserToActivate";s:88:"Envoyer un courriel au super utilisateur afin d\'installer cette nouvelle fonctionnalité";s:29:"TagManagerTeaserHideSuperUser";s:46:"Ne pas afficher cette page à tout utilisateur";s:32:"TagManagerTeaserHideNonSuperUser";s:57:"Pas intéressé(e), ne pas afficher cette page à nouveau";s:34:"TagManagerTeaserEmailSuperUserBody";s:313:"Bonjour, %1$sle Gestionaire de Balises Matomo est maintenant disponible et j\'aimerai utiliser cette nouvelle fonctionnalité. Comme vous avez un accès super utilisateur, pourriez-vous activer cette fonctionnalité via la page de Gestionaire de Balises dans le menu en haut ? %2$sL\'URL Matomo est %3$s. %4$s Merci";s:16:"WhatIsTagManager";s:41:"Qu\'est-ce qu\'un gestionnaire de balises ?";s:24:"WhatIsTagManagerDetails1";s:429:"Similairement à la manière dont un Système de Gestion de Contenu (CMS) vous apporte une flexibilité sur la publication de contenu pour votre site web sans requérir la connaissance technique du HTML/CSS, un Gestionaire de Balises (TMS) est votre solution pour simplifier le processus d\'ajout des balises de suivi d\'applications première et tièrce-partie (aussi connues sous le nom de snippets ou pixels) sur votre site web.";s:24:"WhatIsTagManagerDetails2";s:366:"Supposons que vous vouliez voir les résultats de vos conversions/objectifs, les inscriptions à l\'infolettre, les gadgets sociaux, les popups de sortie et les campagnes de remarketing ; ce qui était autrefois un procédé très technique et chronophage peut maintenant être accompli facilement avec le TMS et demande simplement quelques clics pour l\'implémenter.";s:30:"TagManagerLearnMoreInUserGuide";s:69:"Apprennez en plus via le Guide Utilisateur du Gestionnaire de Balises";s:19:"WhyUsingATagManager";s:37:"Pourquoi un gestionnaire de balises ?";s:27:"WhyUsingATagManagerDetails1";s:291:"Un Gestionnaire de Balises simplifie votre vie ! Vous n\'avez plus besoin d\'attendre qu\'un développeur modifie du code pour votre site web car le Gestionnaire de Balises vous fournit une expérience sans stress pour effectuer ces modifications et les déployer sur votre site web vous-même.";s:27:"WhyUsingATagManagerDetails2";s:144:"Impossible de faire plus pratique, cela vous permet non seulement d\'apporter des changements plus rapidemment mais aussi de réduire les coûts.";s:27:"WhyUsingATagManagerDetails3";s:125:"Cela rend les équipes marketing, digitales et du service informatique heureuses...C\'est gagnant-gagnant pour tout le monde !";s:16:"AreThereAnyRisks";s:30:"Est-ce qu\'il y a des risques ?";s:24:"AreThereAnyRisksDetails1";s:390:"Lorsque vous activez le Gestionnaire de Balises, les utilisateurs avec un accès de type administrateur seront capables de créer des balises HTML, déclencheurs et variables personalisées et pourraient exécuter du JavaScript sur votre site web. Ces modèles personnalisés pourraient être utilisés pour, par exemple, subtiliser des données sensibles de vos utilisateurs (%1$sXSS%2$s).";s:24:"AreThereAnyRisksDetails2";s:285:"Vous pouvez désactiver ces modèles personnalisés sous "Administration => Paramètres Généraux" une fois que vous avez activé le Gestionnaire de Balises. Vous pouvez aussi restreindre l\'utilisation de ces modèles à des utilisateurs ou super utilisateurs spécifiques uniquement.";s:5:"Theme";s:6:"Thème";s:6:"Themes";s:7:"Thèmes";s:17:"ThemesDescription";s:161:"Les thèmes peuvent modifier l\'apparence de l\'interface utilisateur et fournir une expérience visuelle nouvelle pour apprécier les rapports de suivi de trafic.";s:16:"ThemesManagement";s:18:"Gérer les thèmes";s:16:"UninstallConfirm";s:211:"Vous êtes sur le point de désinstaller le composant %s. Ce composant sera supprimé de manière définitive de votre plateforme et cette action est irréversible. Êtes-vous sûr(e) de vouloir effectuer cela ?";s:7:"Version";s:7:"Version";s:25:"ViewAllMarketplacePlugins";s:32:"Voir tous les plugins du marché";s:49:"WeCouldNotLoadThePluginAsItHasMissingDependencies";s:85:"Le composant %1$s n\'a pas pu être chargé car il a des dépendances manquantes: %2$s";s:8:"Websites";s:9:"Sites web";s:14:"UpdateSelected";s:27:"Mise à jour sélectionnée";}s:11:"CoreUpdater";a:95:{s:24:"CheckingForPluginUpdates";s:48:"Vérification des mises à jour pour les plugins";s:25:"ClickHereToViewSqlQueries";s:118:"Cliquez ici pour afficher et copier la liste des requêtes SQL et commandes pour la console qui vont être exécutées";s:36:"CriticalErrorDuringTheUpgradeProcess";s:41:"Erreur critique pendant la mise à jour :";s:23:"DatabaseUpgradeRequired";s:43:"Mise à jour de la base de données requise";s:28:"DisablingIncompatiblePlugins";s:45:"Désactivation des plugins incompatibles : %s";s:22:"DownloadingUpdateFromX";s:45:"Téléchargement de la mise à jour depuis %s";s:9:"DownloadX";s:16:"Télécharger %s";s:18:"EmptyDatabaseError";s:103:"La base de données %s est vide. Vous devez éditer ou supprimer votre fichier de configuration Matomo.";s:12:"ErrorDIYHelp";s:119:"Si vous êtes un utilisateur avancé et que vous rencontrez une erreur lors de la mise à jour de la base de données :";s:14:"ErrorDIYHelp_1";s:81:"identifiez la source exacte du problème (ex, memory_limit ou max_execution_time)";s:14:"ErrorDIYHelp_2";s:50:"exécutez les requêtes restantes qui ont échoué";s:14:"ErrorDIYHelp_3";s:174:"mettez à jour manuellement la table `option` de votre base de données Matomo, en spécifiant la valeur de version_core à la version de celle de l\'échec de la mise à jour";s:14:"ErrorDIYHelp_4";s:138:"ré-exécutez le gestionnaire de mise à jour (en commande ou via le navigateur) pour continuer l\'installation des mises à jour restantes";s:14:"ErrorDIYHelp_5";s:53:"signalez le problème afin que Matomo soit amélioré";s:25:"ErrorDuringPluginsUpdates";s:46:"Erreurs pendant les mises à jour de plugins :";s:29:"ExceptionAlreadyLatestVersion";s:39:"Votre version de Matomo %s est à jour.";s:21:"ExceptionArchiveEmpty";s:13:"Archive vide.";s:28:"ExceptionArchiveIncompatible";s:25:"Archive incompatible : %s";s:26:"ExceptionArchiveIncomplete";s:65:"L\'archive est incomplète : des fichiers sont manquants (ex. %s).";s:15:"FeedbackRequest";s:76:"N\'hésitez pas à partager vos idées et suggestions avec l\'équipe Matomo :";s:18:"HelpMessageContent";s:263:"Allez voir la %1$s FAQ Matomo %2$s qui explique les erreurs courantes lors de la mise à jour. %3$s Demandez à votre administrateur système - il pourra être à même avec cette erreur qui est très probablement liée à la configuration de votre serveur MySQL.";s:32:"HelpMessageIntroductionWhenError";s:129:"Ci-dessus est le message d\'erreur du noyau. Cela devrait expliquer la cause, mais si vous nécessitez davantage d\'aide merci de :";s:34:"HelpMessageIntroductionWhenWarning";s:168:"La mise à jour a été complétée avec succès. Cependant, des problèmes sont survenus. Lisez la description ci-dessus pour plus de détails. Pour davantage d\'aide :";s:39:"HighTrafficPiwikServerEnableMaintenance";s:199:"Si vous gérez un serveur Matomo à haut traffic, nous recommandons de %1$sdésactiver momentanément le suivi des visiteurs et de mettre l\'interface utilisateur de Matomo en mode de maintenance%2$s.";s:37:"IncompatbilePluginsWillBeDisabledInfo";s:225:"Note : certains composants ne sont pas compatibles avec Matomo %s. Nous allons les mettre à jour si une nouvelle version existe sur le Marketplace, autrement nous les désactiverons lorsque vous effectuerez la mise à jour :";s:26:"InstallingTheLatestVersion";s:36:"Installation de la dernière version";s:17:"LatestBetaRelease";s:22:"Dernière version beta";s:19:"LatestStableRelease";s:24:"Dernière version stable";s:20:"LatestXStableRelease";s:27:"Dernière version stable %s";s:18:"LatestXBetaRelease";s:25:"Dernière version beta %s";s:17:"LtsSupportVersion";s:25:"Version Long Term Support";s:19:"ListOfSqlQueriesFYI";s:137:"PVI : ce sont les requêtes SQL et les commandes console qui seront exécutées pour mettre à jour votre base de données vers Matomo %s";s:29:"TheseSqlQueriesWillBeExecuted";s:38:"Ces requêtes SQL seront exécutées :";s:27:"TheseCommandsWillBeExecuted";s:48:"Ces commandes de la console seront exécutées :";s:19:"MajorUpdateWarning1";s:81:"C\'est une mise à jour importante ! Elle va prendre plus de temps que d\'habitude.";s:19:"MajorUpdateWarning2";s:88:"Le conseil suivant est particulièrement important pour des installations conséquentes.";s:17:"NeedHelpUpgrading";s:42:"Besoin d\'aide pour mettre à jour Matomo ?";s:21:"NeedHelpUpgradingText";s:336:"Si vous avez besoin de support pour mettre à jour Matomo, les créateurs de Matomo sont là pour vous aider à faire de votre mise à jour un succès et vous fournir toutes les instructions, bonnes pratiques et du support. %1$sContacter les experts Matomo pour démarrer en effectuer une mise à jour de Matomo en toute sécurité.%2$s";s:26:"NoteForLargePiwikInstances";s:66:"Note importante pour les installations Matomo de taille importante";s:32:"NotificationClickToUpdatePlugins";s:56:"Cliquez ici pour mettre à jour vos plugins maintenant :";s:31:"NotificationClickToUpdateThemes";s:56:"Cliquez ici pour mettre à jour vos thèmes maintenant :";s:38:"NotificationSubjectAvailableCoreUpdate";s:35:"Matomo %s est maintenant disponible";s:40:"NotificationSubjectAvailablePluginUpdate";s:49:"Mises à jour disponibles pour vos plugins Matomo";s:32:"PiwikHasBeenSuccessfullyUpgraded";s:41:"Matomo a été mis à jour avec succès !";s:24:"PiwikUpdatedSuccessfully";s:41:"Matomo a été mis à jour avec succès !";s:41:"PiwikWillBeUpgradedFromVersionXToVersionY";s:92:"La base de données de Matomo sera mise à jour depuis la version %1$s vers la version %2$s.";s:9:"ReadyToGo";s:20:"Prêt à démarrer ?";s:34:"TheFollowingPluginsWillBeUpgradedX";s:45:"Les plugins suivants seront mis à jour : %s.";s:37:"TheFollowingDimensionsWillBeUpgradedX";s:55:"Les dimensions suivantes vont être mises à jour : %s.";s:41:"ThereIsNewPluginVersionAvailableForUpdate";s:66:"Certains de vos plugins ont été mis à jour sur le Marketplace :";s:35:"ThereIsNewVersionAvailableForUpdate";s:53:"Il y a une nouvelle mise à jour de Matomo disponible";s:38:"TheUpgradeProcessMayFailExecuteCommand";s:205:"Si votre base de données Matomo est trop volumineuse, la mise à jour pourra être trop longue pour l\'effectuer depuis le navigateur. Dans ce cas exécutez la mise à jour depuis la ligne de commande : %s";s:45:"TheUpgradeProcessMayTakeAWhilePleaseBePatient";s:65:"Le procédé de mise à jour peut être long, veuillez patienter.";s:18:"UnpackingTheUpdate";s:33:"Décompression de la mise à jour";s:19:"UpdateAutomatically";s:30:"Mettre à jour automatiquement";s:33:"UpdateHasBeenCancelledExplanation";s:281:"La mise à jour de Matomo en un clic a été désactivée. Si vous ne pouvez pas corriger la cause du message d\'erreur ci-dessous, il est recommandé que vous fassiez manuellement la mise à jour de Matomo. %1$sConsultez la documentation%2$s de la mise à jour%3$s pour commencer !";s:11:"UpdateTitle";s:12:"Mise à jour";s:25:"UpdatingPluginXToVersionY";s:49:"Mise à jour du composant %1$s à la version %2$s";s:18:"UpdateSuccessTitle";s:41:"Matomo a été mis à jour avec succès !";s:16:"UpdateErrorTitle";s:22:"Erreur de mise à jour";s:19:"ThankYouUpdatePiwik";s:49:"Merci d\'utiliser Matomo et de le garder à jour !";s:17:"PostUpdateMessage";s:130:"Matomo sera toujours gratuit à télécharger et utiliser, mais il a besoin de votre support continu pour grandir et s\'améliorer.";s:17:"PostUpdateSupport";s:110:"Si vous avez besoin d\'aide pour utiliser Matomo, vous pouvez obtenir du support de la part de ses créateurs :";s:15:"ServicesSupport";s:18:"Services & Support";s:12:"CloudHosting";s:18:"Hébergement Cloud";s:8:"Updating";s:21:"Mise à jour en cours";s:22:"UpdateUsingHttpsFailed";s:126:"Le téléchargement de la dernière version de Matomo via une connexion HTTPS sécurisée a échoué pour la raison suivante :";s:26:"UpdateUsingHttpsFailedHelp";s:477:"Pourquoi est-ce que ça a échoué ? Le téléchargement de la dernière version de Matomo (via une connexion sécurisée HTTPS) peut échouer pour des raisons variées, par exemple à cause d\'une erreur réseau, d\'un réseau lent ou une mauvaise configuration système. Notez que cela pourrait aussi signifier que votre serveur est la cible d\'une attaque de type \\"homme du milieu\\" et que quelqu\'un essaie de remplacer la mise à jour avec une version malveillante de Matomo.";s:34:"UpdateUsingHttpsFailedHelpWhatToDo";s:162:"Il est recommandé de réessayer le téléchargement en utilisant une connexion HTTPS sécurisée car cela empèche les attaques du type "homme du milieu" (MITM).";s:10:"UsingHttps";s:58:"en utilisant une connexion sécurisée HTTPS (recommandé)";s:9:"UsingHttp";s:47:"en utilisant une connexion HTTP non sécurisée";s:15:"UpgradeComplete";s:24:"Mise à jour complète !";s:12:"UpgradePiwik";s:21:"Mettez Matomo à jour";s:24:"ConsoleStartingDbUpgrade";s:122:"Démarrage du processus de mise à jour de la base de données maintenant. Ceci peut prendre du temps, veuillez patienter.";s:20:"DbUpgradeNotExecuted";s:51:"Mise à jour de la base de données non exécutée.";s:34:"ConsoleUpdateUnexpectedUserWarning";s:346:"Il semble que vous avez exécuté cette mise à jour avec l\'utilisateur %1$s alors que les fichiers Matomo appartiennent à %2$s.

Afin de vous assurer que les fichiers de Matomo soient lisibles par le bon utilisateur, vous pourriez devoir exécuter la commande suivante (ou similaire dépendamment de la configuration de votre serveur) :

$ %3$s";s:20:"ConsoleUpdateFailure";s:77:"Matomo n\'a pas pu être mis à jour ! Voir ci-dessus pour plus d\'information.";s:25:"ConsoleUpdateNoSqlQueries";s:69:"Note : il n\'y a aucune requête SQL ou commande console à exécuter.";s:15:"AlreadyUpToDate";s:24:"Tout est déjà à jour.";s:16:"ExecuteDbUpgrade";s:84:"Une mise à jour de la base de données est nécessaire. Exécuter la mise à jour ?";s:6:"DryRun";s:24:"Note : ceci est un essai";s:9:"DryRunEnd";s:14:"Fin de l\'essai";s:25:"ConsoleCommandDescription";s:169:"Déclenche les mises à jour. Utilisez ceci lorsque un des fichiers de Matomo ou des composants a été mis à jour. Ajoutez --yes pour mettre à jour sans confirmation.";s:27:"ConsoleParameterDescription";s:69:"Exécute la mise à jour immédiatement sans demander de confirmation";s:22:"VerifyingUnpackedFiles";s:41:"Vérification des fichiers décompressés";s:15:"WarningMessages";s:26:"Messages d\'avertissement :";s:45:"WeAutomaticallyDeactivatedTheFollowingPlugins";s:64:"Nous avons automatiquement désactivé les plugins suivants : %s";s:43:"YouCanUpgradeAutomaticallyOrDownloadPackage";s:118:"Vous pouvez mettre à jour vers la version %s automatiquement ou télécharger l\'archive et l\'installer manuellement :";s:38:"YouMustDownloadPackageOrFixPermissions";s:193:"Matomo ne peut pas écraser votre installation courante. Vous pouvez soit corriger les permissions du répertoire/fichier, soit télécharger le package et installer la version %s manuellement:";s:23:"YourDatabaseIsOutOfDate";s:90:"Votre base de données est expirée et doit être mise à jour avant de pouvoir continuer.";s:20:"ViewVersionChangelog";s:41:"Voir les changements pour cette version :";s:30:"ReceiveEmailBecauseIsSuperUser";s:103:"Vous recevez ce courriel car vous êtes un super utilisateur de l\'installation Matomo à l\'adresse : %s";s:16:"ConvertToUtf8mb4";s:52:"Convertir la base de données avec le codage UTF8mb4";s:25:"TriggerDatabaseConversion";s:65:"Déclencher en arrière-plan la conversion de la base de données";s:21:"Utf8mb4ConversionHelp";s:1003:"Actuellement, votre base de données n\'utilise pas le codage utf8mb4. Ceci rend impossible le stockage des caractères sur 4 octets tel que les émojis, les caractères moins courants des langues asiatiques, divers scripts historiques ou des symboles mathématiques. Ils sont pour le moment remplacés par %1$s. <br /><br />Votre base de données supporte le codage utf8mb4 et il est possible de la convertir.<br /><br />Si vous pouvez lancer des commandes en console, nous recommandons d\'utiliser cette commande : %2$s<br /><br />Sinon vous pouvez lancer la conversion ici. Elle sera déclenchée automatiquement via une tâche programmée en arrière-plan.<br /><br />Attention : la conversion d\'une base de données peut prendre plusieurs heures selon la taille de la base. Comme le suivi peut ne pas fonctionner durant la conversion, nous ne recommandons pas d\'utiliser ce déclencheur pour les grandes instances.<br /><br />Vous pouvez trouver %3$splus d\'information à ce sujet dans cette FAQ%4$s.";}s:16:"CustomDimensions";a:39:{s:16:"CustomDimensions";s:26:"Dimensions personnalisées";s:21:"CustomDimensionsIntro";s:125:"En créant des %1$sDimensions personnalisées%2$s vous pouvez récupérer n\'importe quelle donnée personnalisé pour \'%3$s\'.";s:25:"CustomDimensionsIntroNext";s:400:"Matomo va créer un rapport pour chacune des dimensions personnalisées (incluant le taux de conversion pour chacun de vos objectifs), ainsi que vous laisser segmenter facilement vos usagers en se basant sur ces valeurs. Les dimensions personnalisées sont similaires aux %1$sVariables personnalisées%2$s mais il existe %3$squelques différences entre les dimensions et variables personnaliées%4$s.";s:21:"ScopeDescriptionVisit";s:149:"Les dimensions personnalisées dans la portée "visite" peuvent être transmises avec n\'importe quelle requête de suivi et stockées avec la visite.";s:29:"ScopeDescriptionVisitMoreInfo";s:131:"Si vous définissez différentes valeurs pour une dimension donnée lors d\'une visite, la dernière valeur définie sera utilisée.";s:22:"ScopeDescriptionAction";s:163:"Les dimensions personnalisées dans la portée "Action" peuvent être transmises avec n\'importe quelle action (vue de page, téléchargement, évènement, etc...).";s:30:"ScopeDescriptionActionMoreInfo";s:145:"Des extractions peuvent être définies de manière à ce que la valeur soit extraite depuis l\'URL, le titre ou des paramètres d\'URL de la page.";s:38:"IncreaseAvailableCustomDimensionsTitle";s:61:"Augmenter le nombre de dimensions personnalisées disponibles";s:42:"IncreaseAvailableCustomDimensionsTakesLong";s:285:"La création d\'une nouvelle dimension personnalisée peut prendre du temps dépendamment de votre base de données puisque cela requiert des modifications du schéma. De ce fait il est possible d\'effectuer cela uniquement via une commande nécessitant une exécution depuis la console.";s:26:"HowToCreateCustomDimension";s:118:"Afin de créer de nouvelles Dimensions Personnalisées exécutez la commande suivante dans votre installation Matomo :";s:31:"HowToManyCreateCustomDimensions";s:320:"Si vous souhaitez créer plusieurs dimensions personnalisées à la fois il suffit simplement d\'ajouter le nombre de dimensions souhaitées à la fin. Comme toutes les modifications de bases de données vont être exécutées en une seule fois, cela ne devrait pas prendre plus de temps de les ajouter toutes à la fois.";s:29:"ExampleCreateCustomDimensions";s:102:"Par exemple pour créer une %s nouvelle dimension de portée "action" exécutez la commande suivante :";s:23:"HowToTrackManuallyTitle";s:48:"Suivre la valeur de cette dimension manuellement";s:23:"HowToTrackManuallyViaJs";s:61:"Pour suivre une valeur depuis le traceur JavaScript appelez :";s:30:"HowToTrackManuallyViaJsDetails";s:109:"Pour plus d\'informations consultez le %1$sguide du suiveur JavaScript pour les dimensions personnalisées%2$s";s:24:"HowToTrackManuallyViaPhp";s:54:"Pour suivre une valeur depuis le traceur PHP appelez :";s:25:"HowToTrackManuallyViaHttp";s:137:"Pour suivre une valeur via l\'API de suivi HTTP utilisez le paramètre de suivi "dimension" suivi de l\'id de la dimension personnalisée :";s:11:"Extractions";s:11:"Extractions";s:15:"ExtractionsHelp";s:538:"Ceci est optionnel. Une regex peut être utilisée pour extraire la valeur de cette dimension personnalisée depuis l\'url ou le titre d\'une page automatiquement. De cette manière la value de la dimension personnalisée n\'a pas besoin d\'être définie manuellement via l\'API de suivi. Une valeur peut toujours être définie via l\'API de suivi Matomo. Les valeurs de dimension définies manuellement via l\'API ont toujours priorité sur celles extraites. Si plusieurs extractions sont définies, la première correspondance est utilisée.";s:12:"ExtractValue";s:18:"Extraire la valeur";s:12:"ExampleValue";s:17:"valeurDeDimension";s:27:"NoCustomDimensionConfigured";s:87:"Aucune dimension personnalisée n\'est encore configurée, configurez-en une maintenant.";s:21:"ConfigureNewDimension";s:33:"Configurer une nouvelle dimension";s:18:"ConfigureDimension";s:49:"Configurer une %1$s Dimension Personnalisée %2$s";s:8:"XofYLeft";s:33:"%1$s de %2$s dimensions restantes";s:15:"CannotBeDeleted";s:78:"Une dimension personnalisée ne peut être supprimée, seulement désactivée.";s:12:"PageUrlParam";s:24:"Paramètre d\'URL de page";s:21:"NameAllowedCharacters";s:104:"Les caractères suivants sont autorisés : lettres, chiffres, espaces, tirets et traits de soulignement.";s:14:"NameIsRequired";s:18:"Un nom est requis.";s:13:"NameIsTooLong";s:70:"Le nom contient trop de caractères, utilisez jusqu\'à %d caractères.";s:30:"ExceptionDimensionDoesNotExist";s:49:"La dimension %d pour le site web %d n\'existe pas.";s:29:"ExceptionDimensionIsNotActive";s:53:"La dimension %d pour le site web %d n\'est pas active.";s:16:"DimensionCreated";s:32:"Dimension personnalisée créée";s:16:"DimensionUpdated";s:37:"Dimension personnalisée mise à jour";s:19:"ColumnUniqueActions";s:15:"Actions uniques";s:24:"ColumnAvgTimeOnDimension";s:27:"Tps. Moyen sur la dimension";s:17:"CustomDimensionId";s:34:"Dimensions personnalisées (Id %d)";s:7:"NoValue";s:13:"aucune valeur";s:10:"EmptyValue";s:11:"valeur vide";}s:15:"CustomJsTracker";a:4:{s:17:"PluginDescription";s:181:"Autorise n\'importe quel composant à mettre à jour le fichier de suivi Matomo (matomo.js) et à ajouter de nouvelles fonctionnalités ainsi que des capacités de suivi de site web.";s:25:"DiagnosticPiwikJsWritable";s:36:"Traceur JavaScript inscriptible (%s)";s:28:"DiagnosticPiwikJsNotWritable";s:231:"Le fichier traceur JavaScript Matomo %sinscriptible ce qui veut dit que d\'autres composants ne peuvent pas le modifier. Dans le futur il se pourrait même que certaines fonctionnalités principales ne fonctionnent pas comme prévu.";s:29:"DiagnosticPiwikJsMakeWritable";s:87:"Nous recommandons de rendre %1$s inscriptible en exécutant la commande suivante : %2$s";}s:7:"DBStats";a:17:{s:13:"DatabaseUsage";s:34:"Utilisation de la base de données";s:8:"DataSize";s:19:"Taille des données";s:6:"DBSize";s:16:"Taille de la BDD";s:13:"EstimatedSize";s:15:"Taille estimée";s:9:"IndexSize";s:17:"Taille de l\'index";s:9:"LearnMore";s:203:"Pour en apprendre plus à propos de la manière dont Matomo traite les données et sur comment faire fonctionner Matomo correctement pour les sites à moyen et fort trafic, consultez la documentation %s.";s:15:"MainDescription";s:132:"Matomo stocke toutes vos donnés de statistiques web dans la base de données MySQL. En ce moment les tables de Matomo utilisent %s.";s:16:"MetricDataByYear";s:31:"Tables de métriques par année";s:12:"MetricTables";s:20:"Tables de métriques";s:11:"OtherTables";s:13:"Autres tables";s:17:"PluginDescription";s:140:"Fournit des rapports détaillés sur l\'utilisation de la base de données MySQL. Disponibles pour les super utilisateurs sous Diagnostiques.";s:16:"ReportDataByYear";s:29:"Tables de rapports par année";s:12:"ReportTables";s:17: