rs !</p>";s:17:"DatabaseAbilities";s:33:"Capacités de la base de données";s:16:"DatabaseCreation";s:32:"Création de la base de données";s:20:"DatabaseErrorConnect";s:71:"Erreur lors de la tentative de connexion au serveur de base de données";s:21:"DatabaseServerVersion";s:38:"Version du serveur de base de données";s:13:"DatabaseSetup";s:35:"Installation de la base de données";s:20:"DatabaseSetupAdapter";s:10:"Adaptateur";s:25:"DatabaseSetupDatabaseName";s:14:"Nom de la base";s:18:"DatabaseSetupLogin";s:18:"Compte utilisateur";s:19:"DatabaseSetupServer";s:27:"Serveur de base de données";s:24:"DatabaseSetupTablePrefix";s:19:"Préfixe des tables";s:5:"Email";s:8:"Courriel";s:9:"Extension";s:9:"Extension";s:10:"Filesystem";s:20:"Système de fichiers";s:11:"GetInvolved";s:68:"Si vous aimez ce que vous voyez, vous pouvez %1$svous impliquer%2$s.";s:21:"GoBackAndDefinePrefix";s:83:"Retournez à la page précédente et définissez le préfixe pour les tables Matomo";s:14:"HappyAnalysing";s:15:"Bonne analyse !";s:12:"Installation";s:12:"Installation";s:18:"InstallationStatus";s:24:"Statut de l\'installation";s:26:"InsufficientPrivilegesHelp";s:247:"Vous pouvez donner ces droits en utilisant un outils tel que phpMyAdmin ou en exécutant les requêtes SQL appropriées. Si vous ne savez pas comment effectuer cela veuillez demander à votre administrateur système de donner ces droits pour vous.";s:26:"InsufficientPrivilegesMain";s:207:"La base de données n\'existe pas (et n\'a pas pu être créée), ou l\'utilisateur spécifié a des privilèges insuffisants. Les utilisateurs de la base de données doivent avoir les privilèges suivants : %s";s:17:"InvalidStateError";s:74:"Erreur : Matomo est déjà installé. %1$s Retourner %2$s vers Matomo%3$s.";s:19:"JsTagArchivingHelp1";s:201:"Pour les sites à moyen et fort trafic il existe des optimisations qui pourraient être mises en place pour aider Matomo à s\'exécuter plus rapidement (comme %1$smettre en place l\'auto-archivage%2$s).";s:18:"JSTracking_EndNote";s:153:"Note : après le processus d\'installation, vous pouvez générer un code de suivi personnalisé depuis la section d\'administration %1$sCode de Suivi%2$s.";s:16:"JSTracking_Intro";s:135:"Pour effectuer le suivi du trafic web avec Matomo vous devez-vous assurer que du code supplémentaire est ajouté sur toutes vos pages.";s:19:"LargePiwikInstances";s:46:"Aide pour les instances de Matomo volumineuses";s:6:"Legend";s:9:"Légendes";s:25:"LoadDataInfileRecommended";s:138:"Si votre serveur Matomo suit des sites à fort trafic (ex. > 100000 pages par mois), nous recommandons d\'essayer de corriger ce problème.";s:29:"LoadDataInfileUnavailableHelp";s:240:"L\'utilisation de %1$s va grandement accélérer la vitesse du processus d\'archivage de Matomo. Pour le rendre disponible à Matomo, essayez de mettre à jour PHP & MySQL et assurez-vous que votre utilisateur MySQL a les privilèges de %2$s.";s:20:"NfsFilesystemWarning";s:49:"Votre serveur utilise un système de fichier NFS.";s:31:"NfsFilesystemWarningSuffixAdmin";s:91:"Cela signifie que Matomo va être très lent lors de l\'utilisation des sessions en fichier.";s:33:"NfsFilesystemWarningSuffixInstall";s:290:"Utiliser les sessions en fichier avec NFS est très lent, donc Matomo va utiliser des sessions en base de données. Si vous avez plusieurs utilisateurs de tableaux de bords en parallèle, vous pourriez avoir besoin d\'augmenter le nombre maximal de connexions au serveur de base de données.";s:17:"NoConfigFileFound";s:103:"Le fichier de configuration Matomo n\'a pu être trouvée et vous essayez d\'accéder à une page Matomo.";s:21:"YouMayInstallPiwikNow";s:47:"Vous pouvez %1$sinstaller Matomo maintenant%2$s";s:37:"IfPiwikInstalledBeforeTablesCanBeKept";s:188:"Si vous avez installé Matomo avant et que vous avez quelques tables dans votre DB, ne vous inquiétez pas, vous pouvez réutiliser les mêmes tables et conserver vos données existantes !";s:8:"Optional";s:9:"Optionnel";s:8:"Password";s:12:"Mot de passe";s:18:"PasswordDoNotMatch";s:31:"Le mot de passe ne concorde pas";s:14:"PasswordRepeat";s:24:"Mot de passe (répétez)";s:11:"PercentDone";s:16:"%s %% complété";s:27:"ProfessionalServicesAdTitle";s:33:"Services et statistiques avancés";s:43:"ProfessionalServicesfessionalServicesAdText";s:109:"Notre réseau d\'experts peut aider votre organisation à exploiter tout le potentiel des statistiques Matomo.";s:40:"ProfessionalServicesfessionalDiscoverHow";s:121:"Découvrez les %1$sproduits et services supplémentaires%2$s pour Matomo et comment augmenter vos conversions et revenus.";s:27:"PleaseFixTheFollowingErrors";s:39:"Merci de corriger les erreurs suivantes";s:15:"DefaultSettings";s:24:"Paramétrage par défaut";s:19:"DefaultSettingsHelp";s:159:"Matomo est installé avec un paramétrage par défaut. Vous pouvez personnaliser ces réglages maintenant ou le faire plus tard dans l\'espace d\'administration.";s:12:"Requirements";s:18:"Pré requis Matomo";s:16:"RestartWebServer";s:72:"Après avoir effectué ces modifications, redémarrez votre serveur web.";s:13:"ReusingTables";s:25:"Réutilisation des Tables";s:18:"PiwikOrgNewsletter";s:70:"Envoyez moi des courriels pour les mises à jour importantes de Matomo";s:30:"ProfessionalServicesNewsletter";s:83:"envoyez-moi des informations à propos %1$sdes services et produits%2$s pour Matomo";s:19:"SeeBelowForMoreInfo";s:41:"Voir ci-dessous pour plus d\'informations.";s:12:"SetupWebsite";s:19:"Paramétrer un site";s:17:"SetupWebsiteError";s:54:"Une erreur a été rencontrée pendant l\'ajout du site";s:16:"SetupWebSiteName";s:15:"Nom du site web";s:24:"SetupWebsiteSetupSuccess";s:29:"Site %s créé avec succès !";s:15:"SetupWebSiteURL";s:15:"URL du site web";s:9:"SiteSetup";s:87:"Veuillez configurer le premier site web que vous voulez suivre et analyser avc Matomo :";s:17:"SiteSetupFootnote";s:111:"Note : une fois que l\'installation de Matomo est terminée, vous pourrez ajouter d\'autres sites web à suivre !";s:9:"SuperUser";s:17:"Super Utilisateur";s:14:"SuperUserLogin"