Speed désactivé";s:27:"SystemCheckPageSpeedWarning";s:300:"Nous recommandons de désactiver le module PageSpeed sur votre serveur web %s: PageSpeed aurait causé plusieurs problèmes avec Matomo, tels que : rapports de Pages cassés, courbe d\'évolution cassé, et d\'autres problèmes difficiles à résoudre. Merci de désactiver mod_pagespeed sur ce server.";s:19:"SystemCheckPackHelp";s:69:"La fonction pack() est requise pour suivre les visiteurs dans Matomo.";s:27:"SystemCheckParseIniFileHelp";s:234:"Cette fonction incluse a été désactivée sur votre serveur. Matomo va essayer d\'émuler cette fonction mais il est possible que vous rencontriez des restrictions de sécurité par la suite. Les performances seront aussi impactées.";s:27:"SystemCheckPdoAndMysqliHelp";s:134:"Sur un serveur linux vous pouvez compiler PHP avec les options suivantes : %1$s Dans votre php.ini, ajoutez les lignes suivantes: %2$s";s:14:"SystemCheckPhp";s:11:"Version PHP";s:26:"SystemCheckPhpPdoAndMysqli";s:60:"Plus d\'informations sur : %1$sPHP PDO%2$s et %3$sMYSQLI%4$s.";s:18:"SystemCheckSplHelp";s:81:"Vous devez configurer et recompiler PHP avec la librairie standard (par défaut).";s:19:"SystemCheckSettings";s:35:"Configuration PHP requise (php.ini)";s:28:"SystemCheckSummaryNoProblems";s:103:"Génial ! Il n\'y a aucun problème avec votre installation de Matomo. Donnez-vous une tape dans le dos.";s:33:"SystemCheckSummaryThereWereErrors";s:164:"Oh-oh ! Matomo a détecté des %1$sproblèmes critiques%2$s avec votre installation de Matomo. %3$sCes problèmes critiques doivent être fixés immédiatement.%4$s";s:35:"SystemCheckSummaryThereWereWarnings";s:119:"Il y a des problèmes avec votre système. Matomo va fonctionner, mais vous pourriez rencontrer des problèmes mineurs.";s:24:"SystemCheckTimeLimitHelp";s:207:"Sur un site à trafic important, le processus d\'archivage peut prendre plus de temps qu\'il n\'est déjà autorisé.<br /> Référez-vous à la configuration max_execution_time de votre php.ini si nécessaire.";s