D5HashExpected";s:66:"Le paramètre mot de passe doit être le hash MD5 du mot de passe.";s:31:"InvalidNonceOrHeadersOrReferrer";s:344:"La sécurité du formulaire a échoué. Veuillez recharger le formulaire et vérifier que vos cookies sont activés. Si vous utilisez un serveur proxy, vous devez %1$s configurer Matomo pour accepter les en-têtes du proxy %2$s qui relaient les en-têtes de l\'hôte. Vérifiez aussi que l\'en-tête de votre référent est correctement transmis.";s:28:"InvalidNonceSSLMisconfigured";s:167:"Aussi, vous devriez %1$s forcer Matomo à utiliser une connexion sécurisée%2$s : dans votre fichier de configuration %3$s définissez %4$s la section ci-dessous %5$s";s:21:"InvalidOrExpiredToken";s:34:"Le jeton est invalide ou a expiré";s:20:"InvalidUsernameEmail";s:42:"Nom d\'utilisateur et/ou courriel invalide.";s:5:"LogIn";s:9:"Connexion";s:12:"LoginOrEmail";s:29:"Nom d\'utilisateur ou courriel";s:11:"HelpIpRange";s:168:"Saisir une adresse IP ou une plage d\'adresses IP par ligne. Vous pouvez utiliser la notation CIDR ex. %1$s ou utiliser les caractères de remplacement, ex. %2$s ou %3$s";s:23:"SettingBruteForceEnable";s:36:"Activer la détection de Force Brute";s:27:"SettingBruteForceEnableHelp";s:671:"La détection de Force Brute est une fonctionnalité de sécurité importante utilisée pour protéger vos données contre tout accès non autorisé. Au lieu de permettre à n\'importe quel utilisateur d\'essayer des milliers, ou des millions de combinaisons de mots de passe dans un temps très court, il ne permettra qu\'un nombre spécifique de connexions échouées dans un court laps de temps. Si trop de connexions échouées se produisent dans cet intervalle de temps, l\'utilisateur ne pourra pas se connecter pendant un certain temps. Veuillez noter que si une adresse IP est bloquée, tous les utilisateurs qui utilisent cette adresse IP seront également bloqués.";s:28:"SettingBruteForceWhitelistIp";s:47:"Ne jamais empêcher ces IP d\'ouvrir une session";s:28:"SettingBruteForceBlacklistIp";s:41:"Toujours empêcher ces IP de se connecter";s:28:"NotAllowListTakesPrecendence";s:161:"Si une IP est à la fois dans la liste «empêcher» et «ne jamais empêcher», c\'est la liste «empêcher» qui prend le dessus et l\'IP ne sera pas autorisée.";s:32:"SettingBruteForceMaxFailedLogins";s:80:"Nombre de tentatives d\'ouverture de session autorisées sur une période donnée";s:36:"SettingBruteForceMaxFailedLoginsHelp";s:123:"Au delà de ce nombre de tentatives échouées de connexion dans l\'intervalle de temps configuré ci-dessous, bloquez l\'IP.";s:26:"SettingBruteForceTimeRange";s:86:"Compter les tentatives d\'ouverture de session dans cette intervalle de temps en minute";s:30:"SettingBruteForceTimeRangeHelp";s:29:"Entrez un chiffre en minutes.";s:20:"ConfirmPasswordReset";s:46:"Confirmer la réinitialisation du mot de passe";s:25:"ConfirmPasswordResetIntro";s:139:"Pour confirmer que vous êtes bien à l\'origine de cette demande de changement de mot de passe, merci de saisir votre nouveau mot de passe.";s:33:"ConfirmPasswordResetWrongPassword";s:294:"Le mot de passe saisi ne correspond pas avec votre nouveau mot de passe. Si vous avez oublié le mot de passe choisi récemment, vous pouvez encore le réinitialiser. Si vous n\'êtes pas à l\'origine de cette demande, vous pouvez simplement l\'ignorer et votre mot de passe ne sera pas modifié.";s:29:"LoginNotAllowedBecauseBlocked";s:130:"Vous n\'êtes pas autorisé à vous connecter actuellement parce que vous avez trop de connexions échouées, réessayez plus tard.";s:19:"CurrentlyBlockedIPs";s:22:"Addresses IP bloquées";s:16:"IPsAlwaysBlocked";s:39:"Ces adresses IP sont toujours bloquées";s:13:"UnblockAllIPs";s:56:"Débloquer toutes les adresses IP actuellement bloquées";s:30:"CurrentlyBlockedIPsUnblockInfo";s:191:"Vous pouvez débloquer les adresses IP actuellement verrouillées pour pouvoir se connecter à nouveau au cas où elles auraient été signalées à tort et auraient besoin de se reconnecter.";s:33:"CurrentlyBlockedIPsUnblockConfirm";s:85:"Êtes-vous sûr de vouloir débloquer toutes les adresses IP actuellement bloquées ?";s:23:"LoginPasswordNotCorrect";s:45:"Mot de passe et nom d\'utilisateur incorrects.";s:16:"LostYourPassword";s:20:"Mot de passe perdu ?";s:18:"ChangeYourPassword";s:23:"Changer de mot de passe";s:23:"MailPasswordChangeBody2";s:340:"Bonjour %1$s,

