tomo n\'utilisera pas l\'adresse IP complète (par exemple %1$s) mais l\'anonymisera (par exemple %2$s). L\'anonymisation des adresses IP est requise par certaines lois adressant la protection de la vie privée dans certains pays comme l\'Allemagne.";s:31:"AnonymizeIpMaskLengtDescription";s:82:"Sélectionnez combien de bytes de l\'adresse IP du visiteur doivent être masqués.";s:21:"AnonymizeIpMaskLength";s:22:"%1$s byte(s) - ex %2$s";s:16:"AskingForConsent";s:21:"Demande de permission";s:18:"ConsentExplanation";s:130:"Le consentement consiste à proposer aux individus le choix et le contrôle au sujet du traitement de leurs données personnelles.";s:17:"ClickHereSettings";s:45:"Cliquez ici pour accéder aux paramètres %s.";s:18:"WhenDoINeedConsent";s:57:"Quand dois-je demander le consentement de l\'utilisateur ?";s:20:"WhenConsentIsNeeded1";s:567:"Dans le cadre de %1$sla réglementation sur la protection de la vie privée RGPD%2$s, lorsque vous traitez des données personnelles, vous devrez demander dans certain cas le consentement des utilisateurs. Pour savoir si vous avez besoin du consentement, vous devez déterminer si votre base légale pour le traitement des données à caractère personnel est le "consentement" ou un "intérêt légitime", ou si vous pouvez éviter de collecter des données à caractère personnel. Nous recommandons d\'en savoir plus sur %3$sla base légale du RGPD pour Matomo%4$s.";s:20:"WhenConsentIsNeeded2";s:241:"A noter que si vous avez besoin du consentement des utilisateurs mais que vous ne pouvez pas prouver que vous l\'avez eu par le passé, alors nous vous recommandons %1$sd\'anonymiser les données brutes de suivi collectées précédemment%2$s.";s:19:"HowDoIAskForConsent";s:51:"Comment demander le consentement des utilisateurs ?";s:31:"HowDoIAskForConsentIntroduction";s:117:"Pour tout savoir sur %1$sla demande de cookies ou le suivi du consentement, consultez notre guide d\'intégration%2$s.";s:14:"AnonymizeSites";s:34:"Anonymiser les données de ce site";s:20:"AnonymizeRowDataFrom";s:45:"Anonymiser les données brutes à partir de :";s:18:"AnonymizeRowDataTo";s:48:"Anonymiser toutes les données brutes jusqu\'à :";s:11:"AnonymizeIp";s:15:"Anonymiser l\'IP";s:15:"AnonymizeUserId";s:53:"Remplacer l\'identifiant utilisateur par un pseudonyme";s:13:"CurrentDBSize";s:38:"Taille actuelle de la base de données";s:8:"DBPurged";s:12:"BDD purgée.";s:17:"DeleteBothConfirm";s:235:"Vous êtes sur le point d\'activer la suppression des données primaires et des données de rapports. Ceci vous empêchera définitivement de visualiser d\'anciennes données de statistique. Êtes-vous sûr(e) de vouloir effectuer cela ?";s:21:"DeleteDataDescription";s:237:"Vous pouvez configurer Matomo pour qu\'il supprime de manière régulière les anciennes données brutes et/ou les rapports agrégés afin de garder votre base de données petite ou bien afin de respecter des régulations telles que GDPR.";s:18:"DeleteDataInterval";s:43:"Supprimer les anciennes données toutes les";s:20:"DeleteOldVisitorLogs";s:44:"Supprimer les journaux des anciens visiteurs";s:16:"DeleteOldRawData";s:55:"Supprimer régulièrement les anciennes données brutes";s:26:"DeleteOldAggregatedReports";s:54:"Supprimer les données des anciens rapports aggrégés";s:21:"DeleteLogDescription2";s:187:"Quand vous activez la suppression automatique des logs, vous devez vous assurer que tous les rapports précédents ont bien été compilés, de cette manière aucune donnée n\'est perdue.";s:17:"DeleteRawDataInfo";s:505:"Les données brutes contiennent tous les détails à propos de chaque visite individuelle et chaque action qu\'ont accompli vos visiteurs. Lorsque vous supprimez les données brutes, les données supprimées ne seront plus disponibles dans le journal des visiteurs. Aussi si vous décidez plus tard de créer un segment, les rapports segmentés ne seront pas disponibles pour la période de temps qui a été supprimée puisque que tous les rapports aggrégrés sont générées depuis ces données brutes.";s:17:"DeleteLogsConfirm";s:292:"Vous êtes sur le point d\'activer suppression des données primaires Si d\'anciennes données sont supprimées et que les rapports n\'ont pas encore été créés, vous ne serez pas en mesure de consulter l\'historique des données de statistiques. Êtes-vous sûr(e) de vouloir effectuer cela ?";s:19:"DeleteLogsOlderThan";s:35:"Supprimer les logs plus anciens que";s:13:"DeleteMaxRows";s:49:"Nombre maximal de lignes à supprimer à la fois:";s:20:"DeleteMaxRowsNoLimit";s:13:"aucune limite";s:20:"DeleteReportsConfirm";s:210:"Vous êtes sur le point d\'activer la suppression des donées de rapports. Si d\'anciens rapports sont supprimés, vous devrez les recalculer afin de les visualiser. Êtes-vous sûr(e) de vouloir effectuer cela ?";s:34:"DeleteAggregateReportsDetailedInfo";s:356:"Lorsque vous activez ce paramètre, tous les rapports aggrégés seront supprimés. Les rapports aggrégés sont générés depuis les données brutes et représentent les données aggrégrées depuis des visites individuelles. Par exemple le rapport "Pays" contient des nombres aggrégés afin de voir combien de visites vous avez obtenues de chaque pays.";s:35:"KeepBasicMetricsReportsDetailedInfo";s:103:"Lorsque vous activez ce paramètre, certains indicateurs clés de performance ne seront pas supprimés.";s:18:"DeleteReportsInfo2";s:137:"Si vous supprimez d\'anciens rapports, ils pourront êtres analysés à nouveau à partir de vos données brutes lorsque vous le demandez.";s:18:"DeleteReportsInfo3";s:126:"Si vous avez aussi activé "%s", alors les données des rapports que vous supprimez seront supprimées de manière permanente.";s:22:"DeleteReportsOlderThan";s:39:"Supprimer les rapports plus anciens que";s:24:"DeleteSchedulingSettings";s:47:"Planifier la suppression des anciennes données";s:18:"DeleteDataSettings";s:56:"Supprimer les journaux et rapports des anciens visiteurs";s:22:"DoNotTrack_Description";s:263:""Ne pas Suivre" (Do Not Track) est une technologie et une proposition de politique qui permet aux utilisateurs de désactiver leur suivi par les sites web qu\'ils ne visitent pas, incluant les services d\'analyse, les réseaux publicitaires et les réseaux sociaux.";s:18:"DoNotTrack_Disable";s:49:"Désactiver la prise en charge de "Ne pas Suivre"";s:19:"DoNotTrack_Disabled";s:124:"Matomo suit actuellement tous les visiteurs, même si ils ont précisé "Je ne veux pas être suivi" dans leurs navigateurs.";s:27:"DoNotTrack_DisabledMoreInfo";s:107:"Nous recommandons d\'activer le support de "Ne pas Suivre" afin de respecter la vie privée de vos visiteurs";s:17:"DoNotTrack_Enable";s:45:"Activer la prise en charge de "Ne pas Suivre"";s:18:"DoNotTrack_Enabled";s:84:"Vous respectez actuellement actuellement la vie privée de vos utilisateurs, Bravo !";s:26:"DoNotTrack_EnabledMoreInfo";s:146:"Quand les utilisateurs ont activé dans leurs navigateurs "Je ne veux pas être suivi" (Do No Track en anglais) Matomo ne suit plus leurs visites.";s:31:"DoNotTrack_SupportDNTPreference";s:49:"Prendre en charge la préférence "Ne Pas Suivre"";s:25:"EstimatedDBSizeAfterPurge";s:54:"Taille estimée de la base de données après la purge";s:19:"EstimatedSpaceSaved";s:23:"Espace libéré estimé";s:26:"GeolocationAnonymizeIpNote";s:137:"Note : La géolocalisation aura à peu près les mêmes résultats avec 1 octet rendu anonyme. Avec 2 octets ou plus, elle sera inexacte.";s:4:"GDPR";s:4:"RGPD";s:11:"GdprManager";s:17:"Gestionnaire RGPD";s:12:"GdprOverview";s:19:"Vue d\'ensemble RGPD";s:9:"GdprTools";s:11:"Outils RGPD";s:16:"GetPurgeEstimate";s:32:"Obtenir l\'estimation de la purge";s:16:"KeepBasicMetrics";s:122:"Conserver les métriques de base (visites, pages vues, taux de rebond, objectif, conversions, conversions ecommerce, etc.)";s:11:"KeepDataFor";s:34:"Conserver toutes les données pour";s:18:"KeepReportSegments";s:74:"Pour les données conservées précédemment, conserver aussi les rapports";s:10:"LastDelete";s:34:"La dernière suppression était le";s:14:"LeastDaysInput";s:57:"Veuillez spécifier un nombre de jours plus grand que %s.";s:16:"LeastMonthsInput";s:54:"Veuillez spécifier un nombre de mois supérieur à %s";s:19:"MenuPrivacySettings";s:11:"Vie privée";s:10:"NextDelete";s:38:"Prochaine suppression programmée dans";s:17:"PluginDescription";s:132:"Augmente le respect de la vie privée de vos utilisateurs et rend votre installation de Matomo conforme avec la législation locale.";s:8:"PurgeNow";s:37:"Purger la base de données maintenant";s:15:"PurgeNowConfirm";s:134:"Vous êtes sur le point de supprimer définitivement les données de votre base de données. Êtes-vous sûr(e) de vouloir continuer ?";s:11:"PurgingData";s:21:"Purge des données...";s:21:"RecommendedForPrivacy";s:45:"Recommandé pour le respect de la vie privée";s:24:"ReportsDataSavedEstimate";s:29:"Taille de la base de données";s:23:"SaveSettingsBeforePurge";s:119:"Vous avez modifié les paramètres de suppression des données. Veuillez les sauvegarder avant de démmarrer une purge.";s:30:"SeeAlsoOurOfficialGuidePrivacy";s:80:"Consultez aussi notre guide officiel : %1$sConfidentialité de l\'analyse web%2$s";s:12:"TeaserHeader";s:348:"Depuis cette page, vous pouvez personnaliser Matomo afin de rendre sa politique de vie privée conforme aux législations, en : %1$sanonymisant l\'adresse IP des visiteurs %2$s, %3$ssupprimant automatiquement les anciens journaux de visites de la base de données %4$s, et en %5$sanonymisant les données brutes de visites déjà enregistrées %6$s.";s:14:"TeaserHeadline";s:26:"Paramètres de vie privée";s:33:"UseAnonymizedIpForVisitEnrichment";s:63:"Utiliser les adresses IP anonymisées pour enrichir les visites";s:37:"UseAnonymizedIpForVisitEnrichmentNote";s:367:"Les composants tels que Geo Location (localisation) par IP et Fournisseur améliorent les métadonnées des visiteurs. Par défaut ces composants utilisent des adresses IP anonymisées. Si vous sélectionnez "Non", l\'adresse IP réelle et complète sera utilisée à la place et cela diminuera le respect de la vie privée mais améliorera la précision des données.";s:22:"PseudonymizeUserIdNote";s:364:"Lorsque vous activez cette option, l\'identifiant utilisateur va être remplacé par un pseudonyme afin d\'éviter de stocker et d\'afficher des information directement identifiables telles qu\'une adresse courriel. En termes techniques: étant donné un identifiant utilisateur, Matomo va générer l\'identifiant avec une fonction de hash utilisant un "grain de sel".";s:23:"PseudonymizeUserIdNote2";s:423:"Note : remplacer par un pseudonyme n\'est pas identique à une anonymisation des données. Dans les termes énoncés par RGPD : un pseudonyme identifiant l\'utilisateur compte toujours comme une données personnelle. L\'identifiant utilisateur originel pourrait toujours être identifié si certaines informations complémentaires étaient disponibles (auxquelles uniquement Matomo et votre traitement de données ont accès).";s:20:"AnonymizeOrderIdNote";s:384:"Parce qu\'un identifiant de commande peut être référencé au travers de plusieurs systèmes, typiquement un magasin de commerce électronique, l\'identifiant de commande pourrait compter comme donnée personnelle pour RGPD. En sélectionnant cette option, un identifiant de commande va être automatiquement anonymisé de sorte qu\'aucune information personnelle ne sera enregistrée.";s:14:"UseAnonymizeIp";s:45:"Rendre anonymes les adresses IP des visiteurs";s:24:"UseAnonymizeTrackingData";s:32:"Anonymiser les données de suivi";s:18:"UseAnonymizeUserId";s:36:"Anonymiser l\'identifiant utilisateur";s:18:"PseudonymizeUserId";s:53:"Remplacer l\'identifiant utilisateur par un pseudonyme";s:19:"UseAnonymizeOrderId";s:39:"Anonymiser l\'identifiant de la commande";s:12:"UseDeleteLog";s:78:"Supprimer les anciennes données brutes de la base de données régulièrement";s:16:"UseDeleteReports";s:69:"Supprimer régulièrement les anciens rapports de la base de données";s:11:"UsersOptOut";s:32:"Désinscription des utilisateurs";s:16:"PrivacyPolicyUrl";s:31:"URL de politique de vie privée";s:27:"