:"Définit dans quel contexte le conteneur sera publié. Actuellement, seulement les conteneurs "Web" sont supportés.";s:24:"ContainerDescriptionHelp";s:133:"Optionnel, vous pouvez décrire les objectifs de conteneur. C\'est particulièrement utile si vous avez plusieurs conteneurs par site.";s:30:"ContainerIdVariableDescription";s:52:"Renvoi l\'ID de ce conteneur, par exemple "ab2Dk432".";s:23:"ContainerIdVariableName";s:15:"ID du conteneur";s:24:"ContainerMetaInformation";s:44:"ID "%1$s" en contexte "%2$s" créé le %3$s.";s:17:"ContainerNameHelp";s:212:"Le nom du conteneur vous laisse définir un nom unique pour ce conteneur. Prenez en considération que le nom sera disponible en tant que variable et donc visible publiquement dans le code source de cette balise.";s:36:"ContainerRevisionVariableDescription";s:53:"Renvoi la révision de ce conteneur, par exemple "5".";s:29:"ContainerRevisionVariableName";s:22:"Révision du conteneur";s:22:"ContainerUsageBenefits";s:429:"Chaque conteneur possède ses propres balises qui seront ajoutées à votre site. Une fois que vous avez créé un conteneur, vous recevrez un code HTML à ajouter à votre site. En principe vous devriez avoir un conteneur par site. Cependant si vous souhaitez plusieurs conteneurs par site, par exemple si un site dans Matomo représente plusieurs sites ou si plusieurs équipes sont responsables de plusieurs parties d\'un site.";s:35:"ContainerVersionVariableDescription";s:34:"Renvoi la version de ce conteneur.";s:28:"ContainerVersionVariableName";s:30:"Nom de la version du conteneur";s:10:"ContainerX";s:14:"Conteneur "%s"";s:10:"Containers";s:10:"Conteneurs";s:7:"Context";s:8:"Contexte";s:10:"ContextWeb";s:3:"Web";s:29:"ContextWebInstallInstructions";s:137:"Pour installer ce conteneur, copiez / collez le code suivant aussi haut que possible dans la partie %1$sde chaque page de votre site web.";s:25:"CookieVariableDescription";s:31:"Lit une valeur depuis un cookie";s:18:"CookieVariableName";s:20:"Cookie premier-tiers";