te manière vous pouvez par exemple exécuter certaines actions quand un produit est ajouté au panier ou lorsqu\'un utilisateur s\'identifie.";s:22:"CustomEventTriggerName";s:25:"Évènement personnalisé";s:24:"CustomHtmlTagDescription";s:78:"Vous permet d\'incorporer n\'importe quel HTML, JavaScript ou CSS personnalisé.";s:17:"CustomHtmlTagHelp";s:180:"La balise HTML personnalisée vous permet d\'embarquer n\'importe quelle balise qui n\'est pas encore supportée. Les possibilité avec ce déclencheur sont plus ou moins illimitées.";s:17:"CustomHtmlTagName";s:18:"HTML personnalisé";s:22:"LinkedinInsightTagName";s:23:"Balise aperçu LinkedIn";s:29:"LinkedinInsightTagDescription";s:118:"Ajoute la balise d\'aperçu LinkedIn afin de vous permettre d\'appliquer le suivi des conversions de campagnes LinkedIn.";s:22:"LinkedinInsightTagHelp";s:321:"Cette balise va activer un détail des campagnes et des informations à propos des visiteurs de votre site web dans LinkedIn. Cela vous permet de suivre les conversions, re-cibler les visiteurs du site web et d\'obtenir un aperçu additionnel à propos des membres LinkedIn qui interagissent avec vos publicités LinkedIn.";s:25:"CustomImageTagDescription";s:79:"Vous permet d\'incorporer n\'importe quelle image, par exemple un pixel de suivi.";s:18:"CustomImageTagHelp";s:96:"Cette balise vous permet par exemple d\'ajouter un pixel transparent de suivi sur votre site web.";s:18:"CustomImageTagName";s:20:"Image personnalisée";s:35:"CustomJsFunctionVariableDescription";s:73:"Exécute une fonction JavaScript personnalisée afin d\'obtenir la valeur.";s:28:"CustomJsFunctionVariableName";s:24:"JavaScript personnalisé";s:15:"CustomVariables";s:25:"Variables personnalisées";s:17:"CustomizeTracking";s:22:"Personnaliser le suivi";s:23:"CustomizeTrackingTeaser";s:129:"Vous souhaitez configurer le suivi Matomo ce conteneur ? Voici une liste des configurations Matomo existantes pour ce conteneur :";s:28:"DataLayerVariableDescription";s:59:"Lit une valeur personnalisée depuis la couche de données.";s:21:"DataLayerVariableHelp";s:219:"En utilisant cette variable vous pouvez accéder à n\'importe quelle valeur qui est disponible dans la couche de données. Vous pouvez aussi ajouter des valeurs à la couche de données vous-même et y accéder ensuite.";s:21:"DataLayerVariableName";s:18:"Couche de données";s:16:"DefaultContainer";s:21:"Conteneur par défaut";s:12:"DefaultValue";s:18:"Valeur par défaut";s:16:"DefaultValueHelp";s:410:"Vous pouvez configurer une valeur par défaut qui sera utilisée si la variable ne retourne aucune valeur. Veuillez noter qu\'une chaine de caractères vide (\'\') est considérée comme une valeur et n\'utilisera pas la valeur par défaut, configurez une valeur de référence dans ce cas si besoin. Veuillez aussi noter que la valeur par défaut sera appliquée avant que la valeur de référence soit évaluée.";s:22:"DeleteContainerConfirm";s:295:"Êtes-vous sûr(e) de vouloir supprimer ce conteneur ? Vous ne pouvez annuler cette suppression. Veuillez vous assurer de supprimer tout code embarqué pour ce conteneur de votre site web car les fichiers liés au conteneur ne seront plus disponibles après que vous ayez supprimé ce conteneur.";s:16:"DeleteTagConfirm";s:95:"Êtes-vous sûr(e) de vouloir supprimer cette balise ? vous ne pourrez pas revenir en arrière.";s:20:"DeleteTriggerConfirm";s:98:"Êtes-vous sûr(e) de vouloir supprimer ce déclencheur ? vous ne pourrez pas revenir en arrière.";s:21:"DeleteVariableConfirm";s:97:"Êtes-vous sûr(e) de vouloir supprimer cette variable ? vous ne pourrez pas revenir en arrière.";s:20:"DeleteVersionConfirm";s:96:"Êtes-vous sûr(e) de vouloir supprimer cette version ? vous ne pourrez pas revenir en arrière.";s:7:"DeleteX";s:12:"Supprimer %s";s:9:"DiffAdded";s:10:"Ajouté(e)";s:12:"DiffModified";s:11:"Modifié(e)";s:11:"DiffDeleted";s:12:"Supprimé(e)";s:14:"DisablePreview";s:32:"Désactiver la prévisualisation";s:26:"DisablingPreviewPleaseWait";s:66:"Désactivation du mode de prévisualisation