ine de caractères ou bien un nombre.";s:45:"ErrorVariableNameInUseByPreconfiguredVariable";s:92:"Ce nom de variable ne peut être utilisé car une variable préconfigurée l\'utilise déjà.";s:27:"ErrorVersionCannotBeDeleted";s:56:"La version "%1$s" du conteneur ne peut être supprimée.";s:38:"ErrorVersionCannotBeDeletedAsPublished";s:91:"Cette version ne peut être supprimée car elle est publiée sur au moins un environnement.";s:17:"ErrorXNotProvided";s:40:"Veuillez fournir une valeur pour "%1$s".";s:20:"ErrorXNotWhitelisted";s:77:"La valeur pour "%1$s" n\'est pas autorisée, utilisez une valeur parmi : %2$s.";s:13:"ErrorXTooLong";s:60:""%1$s" est trop long, %2$scaractères autorisés au maximum.";s:15:"EtrackerTagName";s:25:"statistiques web etracker";s:22:"EtrackerTagDescription";s:107:"etracker est un system de statistiques web, vous pouvez choisir d\'envoyer la vue de page ou un évènement.";s:6:"Except";s:8:"Excepté";s:11:"ExportDraft";s:21:"Exporter le brouillon";s:7:"ExportX";s:11:"Exporter %s";s:27:"FacebookPixelTagDescription";s:86:"Facebook Pixel est un service de statistiques web et de promotion offert par Facebook.";s:20:"FacebookPixelTagHelp";s:195:"Cette balise vous permet de suivre vos vues de pages de site web au sein de votre compte Facebook Ads. Afin d\'obtenir l\'identifiant du Pixel veuillez vous connecter sur votre compte Facebook Ads.";s:20:"FacebookPixelTagName";s:14:"Facebook Pixel";s:6:"Filter";s:7:"Filtrer";s:9:"FireDelay";s:20:"Délais d\'activation";s:13:"FireDelayHelp";s:253:"Vous permet de retarder l\'exécution de cette balise. Ceci peut être utile si par exemple vous souhaitez permettre à un déclencheur d\'attendre avant d\'exécuter la balise. La valeur est attendue en millisecondes où 1000ms équivalent à une seconde.";s:9:"FireLimit";s:19:"Limite d\'activation";s:13:"FireLimitHelp";s:839:"La limite de déclenchement définit à quelle fréquence la balise sera exécutée. Si définie à "%1$s", alors la balise sera exécutée à chaque fois qu\'un des déclencheurs associés sera déclenché. Si définie à "%2$s", alors la balise sera exécutée au maximum une fois par vue de page. "%3$s" signifie que cette balise ne sera pas exécutée une autre fois dans les prochaines 24 heures. L\'ouverture d\'une nouvelle fenêtre ou d\'un nouvel onglet pourrait démarrer une nouvelle session. "%4$s" signifie que cette balise sera exécutée une fois seulement. Veuillez noter que pour que cela fonctionne des informations seront stockées sur le navigateur basées sur le nom de la balise. Cela signifie que si vous choisissez "%4$s" et changez le nom de cette balise, la balise sera exécutée une fois de plus pour tout le monde.";s:15:"FireTriggerHelp";s:386:"Cette balise sera exécutée à chaque fois qu\'un de ces déclencheurs est déclenché. Il n\'est pas nécessaire que tous les déclencheurs soient déclenchés afin que cette balise soit exécutée. Souhaitez-vous exécuter le déclencheur une seule fois par vue ou session ? Vous pouvez limiter la fréquence d\'exécution de la balise dans les paramètres avancés en modifiant "%1$s".";s:16:"FireTriggerTitle";s:84:"Exécute cette balise lorsque n\'importe lequel de ces déclencheurs est déclenché.";s:33:"FirstDirectoryVariableDescription";s:61:"Retourne le premier répertoire de l\'URL de la page courante.";s:26:"FirstDirectoryVariableName";s:25:"Premier répertoire d\'URL";s:23:"FormElementVariableName";s:22:"Elément de formulaire";s:30:"FormElementVariableDescription";s:44:"Une instance de l\'élément a été soumise.";s:30:"FormClassesVariableDescription";s:59:"La valeur de toutes les classes CSS d\'un formulaire soumis.";s:23:"FormClassesVariableName";s:21:"Classes du formulaire";s:35:"FormDestionationVariableDescription";s:49:"La valeur de l\'URL d\'action du formulaire soumis.";s:28:"FormDestionationVariableName";s:32:"URL de destination du formulaire";s:25:"FormIdVariableDescription";s:47:"Valeur de l\'attribut ID d\'un formulaire soumis.";s:18:"FormIdVariableName";s:13:"ID formulaire";s:27:"FormNameVariableDescription";s:54:"La valeur de l\'attribut de nom d\'un formulaire soumis.";s:20:"FormNameVariableName";s:17:"Nom du formulaire";s:28:"FormSubmitTriggerDescription";s:44:"Déclenché lorsqu\'un formulaire est soumis.";s:21:"FormSubmitTriggerHelp";s:203:"Déclenché lorsqu\'un formulaire sur la page courante est soumis. Pour suivre des formulaires en particulier, veuillez ajouter des conditions basées sur la variable "form" dans les paramètres avancés.";s:21:"FormSubmitTriggerName";s:17:"Formulaire soumis";s:28:"FullscreenTriggerDescription";s:73:"Déclenché lorsque que la fenêtre entre ou quitte le mode plein écran.";s:21:"FullscreenTriggerName";s:12:"Plein écran";s:14:"GettingStarted";s:9:"Commencer";s:20:"GettingStartedNotice";s:111:"Vous souhaitez apprendre ce qu\'un Gestionnaire de Balises est ? Cliquez sur "Démarrez" dans le menu de gauche.";s:25:"GettingStartedWhatIsIntro";s:337:"Le gestionnaire de tag Matomo vous permet de gérer et homogénéiser toutes les balises de suivi et de marketing. Les balises sont aussi connues comme des snippets ou pixels. Ces balises sont typiquement du code JavaScript ou HTML et vous permettent d\'intégrer diverses fonctionnalités dans votre site en quelques clics, par exemple :";s:31:"GettingStartedAnalyticsTracking";s:31:"Suivi des données statistiques";s:32:"GettingStartedConversionTracking";s:21:"Suivi des conversions";s:31:"GettingStartedNewsletterSignups";s:28:"Inscriptions à l\'infolettre";s:25:"GettingStartedExitActions";s:34:"Quitter des popups et des sondages";s:25:"GettingStartedRemarketing";s:11:"Remarketing";s:27:"GettingStartedSocialWidgets";s:28:"Gadgets des réseaux sociaux";s:24:"GettingStartedAffiliates";s:9:"Affiliés";s:17:"GettingStartedAds";s:11:"Publicités";s:21:"GettingStartedAndMore";s:14:"et plus encore";s:28:"GettingStartedMainComponents";s:61:"Ceci est réalisable en utilisant ces principaux composants :";s:26:"GettingStartedTagComponent";s:100:"Balises - Un fragment de code (généralement en JavaScript ou HTML) qui sera ajouté à votre site.";s:30:"GettingStartedTriggerComponent";s:64:"Déclencheurs - Détermine quand une balise doit être appelée.";s:31:"GettingStartedVariableComponent";s:113:"Variables - Permet de récupérer des données qui peuvent être utilisées par des balises et des déclencheurs.";s:24:"GettingStartedWhyDoINeed";s:63:"Pourquoi et quand dois-je utiliser un gestionnaire de balises ?";s:32:"GettingStartedWhyMakesLifeEasier";s:491:"Un gestionnaire de balises vous facilite la vie lorsque vous voulez modifier un fragment de code sur votre site car vous n\'aurez plus besoin d\'un développeur pour faire les modifications dont vous avez besoin. Au lieu d\'attendre quelqu\'un pour faire des modifications et les déployer sur votre site, vous pouvez facilement faire vous-même les changements nécessaires. Cela vous permet non seulement d\'apporter des changements sur le marché rapidement, mais aussi de réduire les coûts.";s:35:"GettingStartedWhyThirdPartySnippets";s:239:"C\'est également pratique si vous intégrez de nombreux codes de services tiers dans votre site web et souhaitez les mettre en ordre pour superviser tous les fragments de code qui sont intégrés et avoir un moyen pratique pour les gérer.";s:36:"GettingStartedWhyAccuracyPerformance";s:167:"Le gestionnaire de balises s\'assure que tous les fragments de code sont implémentés correctement et chargés de manière optimale pour des performances plus rapides.";s:20:"GettingStartedHowDoI";s:27:"Comment puis-je commencer ?";s:32:"GettingStartedHowCreateContainer";s:86:"Si vous n\'avez pas encore créé de conteneur, %1$scréez un conteneur maintenant%2$s.";s:25:"GettingStartedHowCopyCode";s:250:"Ensuite vous devez copier/coller le code du conteneur dans votre site web, il s\'agit d\'un simple fragment de code HTML. A partir de là, ce code chargera tous les autres codes et vous n\'aurez plus besoin de faire des modifications sur votre site web.";s:35:"GettingStartedHowAddTagsToContainer";s:319:"Maintenant vous pouvez ajouter un ou plusieurs fragments de code dans votre conteneur. Si vous avez embarqué du code manuellement dans votre site par le passé, vous devez en même temps enlever tous les fragments ajoutés précédemment sur votre site web puisqu\'ils seront chargés depuis le gestionnaire de balises.";s:31:"GettingStartedWhatIfUnsupported";s:93:"Que faire si un code, déclencheur ou variable dont j\'ai besoin n\'est pas encore disponible ?";s:24:"GettingStartedCustomTags";s:179:"Il y a des balises personnalisés, des déclencheurs et des variables disponibles pour vous permettre d\'implémenter à peu près tous les cas d\'utilisation dont vous avez besoin.";s:28:"GettingStartedContributeTags";s:305:"Si vous utiliser des fonctionnalités qui ne sont pas encore disponibles ou si vous avez un service que vous voulez intégrer au gestionnaire de balises, merci de consulter notre %1$sdocumentation pour développeur%2$s sur l\'ajout de ces propres balises, déclencheurs et variables. C\'est vraiment simple.";s:38:"GoogleAnalyticsUniversalTagDescription";s:70:"Google analytics est un service de statistiques web offert par Google.";s:31:"GoogleAnalyticsUniversalTagHelp";s:179:"Cette balise vous permet de suivre les visites de votre site web dans Google Analytics. Afin d\'obtenir le "Property-ID" veuillez vous identifier sur votre compte Google Analytics.";s:31:"GoogleAnalyticsUniversalTagName";s:28:"Google Analytics (Universel)";s:20:"HideAdvancedSettings";s:32:"Masquer les paramètres avancés";s:31:"HistoryChangeTriggerDescription";s:41:"Déclenché lorsque l\'URL courante change";s:24:"HistoryChangeTriggerName";s:23:"Changement d\'historique";s:30:"HistoryHashNewPathVariableName";s:27:"Nouveau chemin d\'historique";s:32:"HistoryHashNewSearchVariableName";s:31:"Nouvelle recherche d\'historique";s:29:"HistoryHashNewUrlVariableName";s:25:"Nouvelle URL d\'historique";s:26:"HistoryHashNewVariableName";s:27:"Nouvelle ancre d\'historique";s:30:"HistoryHashOldPathVariableName";s:26:"Ancien chemin d\'hi