eurs de votre site web.";s:23:"LivezillaDynamicTagHelp";s:155:"Cette balise vous permet d\'ajouter l\'intégration Code Dynamique de Livezilla afin de discuter avec vos clients ou bien seulement de suivre votre site web.";s:28:"LocalDateVariableDescription";s:72:"La date locale courante de l\'utilisateur, par exemple "Lun 19 Mar 2018".";s:21:"LocalDateVariableName";s:11:"Date locale";s:28:"LocalHourVariableDescription";s:49:"L\'heure locale courante, par exemple "8" ou "11".";s:21:"LocalHourVariableName";s:12:"Heure locale";s:28:"LocalTimeVariableDescription";s:80:"L\'heure locale courant de l\'utilisateur, par exemple "14:00:00 GMT+1300 (NZDT)".";s:21:"LocalTimeVariableName";s:11:"Temps local";s:11:"LookupTable";s:20:"Table de référence";s:21:"LookupTableMatchValue";s:12:"cette valeur";s:19:"LookupTableOutValue";s:30:"ensuite convertir cette valeur";s:16:"LookupTableTitle";s:107:"Convertit la valeur d\'une variable automatiquement en une autre valeur quand la valeur de cette variable...";s:7:"ManageX";s:9:"Gérer %s";s:6:"Change";s:8:"Modifier";s:16:"DetectingChanges";s:29:"Détection des changements...";s:23:"ChangesSinceLastVersion";s:39:"Changements depuis la dernière version";s:38:"MatomoConfigurationVariableDescription";s:56:"Définit une configuration pour les statistiques Matomo.";s:31:"MatomoConfigurationVariableName";s:20:"Configuration Matomo";s:20:"MatomoTagDescription";s:105:"Matomo, anciennement connu sous le nom de Piwik, est la première plateforme open source de statistiques.";s:13:"MatomoTagHelp";s:156:"Cette balise vous permet de suivre les vues de page et évènement dans Matomo. Vous pouvez aussi personnaliser le code de suivi en fonction de vos besoins.";s:13:"MatomoTagName";s:19:"Statistiques Matomo";s:30:"MetaContentVariableDescription";s:37:"Lit une valeur d\'un élément "meta".";s:23:"MetaContentVariableName";s:23:"Meta-Contenu de la page";s:19:"NameOfLatestVersion";s:41:"Le nom de la version précédente est %s.";s:5:"Names";s:4:"Noms";s:17:"NoConta