ableName";s:14:"URL de la page";s:26:"PageViewTriggerDescription";s:80:"Déclenché dès lors que le Gestionnaire de balises est exécuté dans la page.";s:19:"PageViewTriggerName";s:8:"Page vue";s:24:"PingdomRUMTagDescription";s:128:"Le suivi d\'utilisateur réel Pingdom vous permet de collecter des données de performance de visiteurs réels de votre site web.";s:17:"PingdomRUMTagHelp";s:94:"Cette balise vous permet d\'ajouter le suivi des utilisateurs réels Pingdom à votre site web.";s:17:"PluginDescription";s:81:"Gérez et unifiez tous vos codes de suivi et de marketing depuis un seul endroit.";s:22:"PreConfiguredInfoTitle";s:271:"Les variables préconfigurées sont des variables qui sont prêtes à être utilisées et qui ne peuvent être créées, modifiées ou configurées. Elles fonctionnent directement et vous pouvez les utiliser au sein des balises, déclencheurs et variables si nécessaire.";s:22:"PreconfiguredVariables";s:27:"Variables pré-configurées";s:31:"PreviewDebugEnabledNotification";s:374:"Le mode de prévisualisation est %1$s. Accédez à votre site web pour déboguer le conteneur maintenant. Si vous voulez %2$spartager la prévisualisation%3$s avec quelqu\'un d\'autre, veuillez ajouter %4$s ou %5$s à l\'URL du site web. Tant que ce mode est activé, le conteneur en prévisualisation sera automatiquement mis à jour lorsque vous effectuez un changement. %6$s";s:30:"PreviewModeVariableDescription";s:77:"Retourne "1" ou "0" en fonction de l\'activation du mode de prévisualisation.";s:23:"PreviewModeVariableName";s:25:"Mode de prévisualisation";s:8:"Priority";s:9:"Priorité";s:12:"PriorityHelp";s:153:"Le plus bas la priorité est, le plus tôt cette balise sera déclenchée quand autrement plusieurs balises auraient été déclenchées au même moment.";s:7:"Publish";s:7:"Publier";s:14:"PublishRelease";s:18:"Publier la version";s:14:"PublishVersion";s:29:"Publier la version "%s" en…";s:42:"PublishVersionToEnvironmentToViewEmbedCode";s:88:"Veuillez publier une version dans un environnement afin d\'afficher le code de suivi ici.";s:40:"PublishLiveEnvironmentCapabilityRequired";s:142:"Veuillez noter qu\'uniquement un usage de type "Admin", ou un usager avec la permission "%1$s" peut publier vers l\'environnement de production.";s:20:"RaygunTagDescription";s:55:"Logiciel de suivi d\'erreur, de crash et de performance.";s:13:"RaygunTagHelp";s:64:"Cette balise ajoute le SDK officiel raygun4js à votre site web.";s:31:"RandomNumberVariableDescription";s:88:"Retourne un nombre aléatoire à chaque fois que la valeur de la variable est demandée.";s:24:"RandomNumberVariableName";s:17:"Nombre aléatoire";s:30:"ReferrerUrlVariableDescription";s:41:"Obtient la valeur de l\'URL du référant.";s:23:"ReferrerUrlVariableName";s:17:"URL du référent";s:27:"ReferrerVariableDescription";s:39:"Retourne l\'URL complète du référant.";s:20:"ReferrerVariableName";s:17:"URL du référent";s:11:"ReleaseInfo";s:25:"Publié par %1$s le %2$s.";s:18:"ReleaseVersionInfo";s:21:"Nom de la version %s.";s:8:"Released";s:10:"Publié(e)";s:10:"ReleasedBy";s:14:"Publié(e) par";s:10:"ReleasedOn";s:13:"Publié(e) le";s:16:"ReleasesOverview";s:30:"Aperçu des versions publiées";s:8:"Revision";s:9:"Révision";s:40:"ScreenHeightAvailableVariableDescription";s:86:"Hauteur totale de l\'écran disponible au sein de la fenêtre du navigateur (viewport).";s:33:"ScreenHeightAvailableVariableName";s:27:"Hauteur d\'écran disponible";s:31:"ScreenHeightVariableDescription";s:53:"Hauteur totale de l\'écran du périphérique courant.";s:24:"ScreenHeightVariableName";s:16:"Hauteur d\'écran";s:39:"ScreenWidthAvailableVariableDescription";s:86:"Largeur totale de l\'écran disponible au sein de la fenêtre du navigateur (viewport).";s:32:"ScreenWidthAvailableVariableName";s:27:"Largeur d\'écran disponible";s:30:"ScreenWidthVariableDescription";s:50:"Largeur d\'écran totale du périphérique courant.";s:23:"ScreenWidthVariableName";s:16:"Largeur d\'écran";s:45:"ScrollHorizontalPercentageVariableDescription";s:100:"Jusqu\'où l\'utilisateur a fait défiler horizontalement la page, par exemple "75.59" pour "75.59%%".";s:38:"ScrollHorizontalPercentageVariableName";s:37:"Pourcentage de défilement horizontal";s:34:"ScrollLeftPixelVariableDescription";s:83:"Jusqu\'où l\'utilisateur a fait défiler horizontalement la page, par exemple "592".";s:27:"ScrollLeftPixelVariableName";s:27:"Pixel de défilement gauche";s:29:"ScrollReachTriggerDescription";s:93:"Déclenché dès lors que l\'utilisateur fait défiler la page jusqu\'à une certaine position.";s:22:"ScrollReachTriggerHelp";s:227:"Ce déclencheur est déclenché lorsqu\'un utilisateur fait défiler la page ou bien redimensionne la fenêtre du navigateur. Ce déclencheur n\'est pas déclenché lorsque l\'utilisateur fait défiler un élément en particulier.";s:22:"ScrollReachTriggerName";s:22:"Portée du défilement";s:31:"ScrollSourceVariableDescription";s:156:"Si le défilement de position vient d\'un défilement de l\'utilisateur ou bien d\'un redimensionnement du navigateur. La valeur est "scroll" ou bien "resize".";s:24:"ScrollSourceVariableName";s:21:"Source de défilement";s:33:"ScrollTopPixelVariableDescription";s:91:"Jusqu\'où l\'utilisateur a fait défiler verticalement la page en pixels, par exemple "592".";s:26:"ScrollTopPixelVariableName";s:25:"Pixel de défilement haut";s:43:"ScrollVerticalPercentageVariableDescription";s:98:"Jusqu\'où l\'utilisateur a fait défiler verticalement la page, par exemple "75.59" pour "75.59%%".";s:36:"ScrollVerticalPercentageVariableName";s:35:"Pourcentage de défilement Vertical";s:25:"SentryRavenTagDescription";s:122:"Sentry.io est outils libre de suivi d\'erreurs qui vous permet de détecter les erreurs qui surviennent sur votre site web.";s:18:"SentryRavenTagHelp";s:149:"Cette balise ajoute Raven.js, le SDK JavaScript officiel. Démarrez en vous inscrivant sur sentry.io ou en installant votre propre instance de suivi.";s:34:"SeoCanonicalUrlVariableDescription";s:37:"Retourne l\'URL canonique si définie.";s:27:"SeoCanonicalUrlVariableName";s:13:"URL canonique";s:27:"SeoNumH1VariableDescription";s:91:"Le nombre d\'éléments H1 qui sont présents sur la page courante. Utile pour le suivi SEO.";s:20:"SeoNumH1VariableName";s:22:"Nombre d\'éléments H1";s:27:"SeoNumH2VariableDescription";s:82:"Le nombre d\'éléments H2 présents sur la page courante. Utile pour le suivi SEO.";s:20:"SeoNumH2VariableName";s:21:"Nombre d\'élément H2";s:33:"SettingCustomTemplatesDescription";s:836:"Ce paramètre définit qui peut utiliser des modèles personnalisés ou bien s\'ils doivent être complètement désactivés. Modifier ce paramètre peut améliorer la sécurité de votre site web. Lorsque vous configurez un déclencheur, une balise, une variable, certains d\'entre eux pourraient permettre aux utilisateurs Matomo d\'ajouter du HTML ou JavaScript qui sera exécuté sur votre site web. Entrer du code personnalisé peut non seulement faire cesser le conteneur de fonctionner en cas d\'erreur mais aussi leur permettre d\'exécuter n\'importe quel code JavaScript sur votre site web. Ceci peut être détourné afin de subtiliser par exemple des données sensibles de votre site web. Si vous ne voulez pas autoriser les membres de votre équipe à saisir n\'importe quel code JavaScript vous devriez désactiver ce paramètre.";s:27:"SettingCustomTemplatesTitle";s:46:"Restreindre l\'usage de modèles personnalisés";s:29:"SettingEnvironmentDescription";s:220:"Définissez un ou plusieurs environnements additionnels. Veuillez noter que si vous supprimez un environnement, les fichiers de conteneurs générés pour cet environnement spécifique seront supprimés et indisponibles.";s:30:"SettingCustomTemplatesDisabled";s:42:"Désactivé, personne ne peut les utiliser";s:27:"SettingCustomTemplatesAdmin";s:85:"Les utilisateurs avec des permissions administratives au minimum peuvent les utiliser";s:31:"SettingCustomTemplatesSuperUser";s:54:"Uniquement les super utilisateurs peuvent les utiliser";s:25:"ShareaholicTagDescription";s:55:"Outils de marketing de contenu et de trafic de site web";s:18:"ShareaholicTagHelp";s:104:"Cette balise vous permet d\'ajouter les boutons de médias sociaux Shareaholic et plus à votre site web.";s:20:"ShowAdvancedSettings";s:33:"Afficher les paramètres avancés";s:9:"StartDate";s:14:"Date de début";s:3:"Tag";s:6:"Balise";s:14:"TagEndDateHelp";s:158:"SI définit, cette balise ne sera déclenchée uniquement jusqu\'à cette date. La date spécifiée sera calculée en fonction de %1$svotre fuseau horaire%2$s.";s:25:"TagFireTriggerRequirement";s:50:"Vous devez sélectionner au moins un déclencheur.";s:10:"TagManager";s:23:"Gestionnaire de balises";s:22:"TagManagerTrackingInfo";s:380:"Vous ne savez pas ce qu\'est un Gestionnaire de balises ? Allez voir notre %1$sGuide de démarrage%2$s. Si vous embarquez de nombreuses resources provenant de tierces parties sur votre site web, alors effectuer le suivi de votre site web en utilisant %3$sun gestionnaire de balises%4$s sera probablement la meilleure option au lieu d\'utiliser le code JavaScript de suivi régulier.";s:11:"TagNameHelp";s:257:"Le nom de la balise vous permet de définir un nom unique qui vous permettre d\'identifier rapidemment la balise. Veuillez noter que ce nom sera visible de manière publique dans le code source de la balise lorsque vous prévisualisez/déboguez ce conteneur.";s:16:"TagStartDateHelp";s:154:"Si définie, la balise sera exécutée uniquement après cette date de début. La date spécifiée sera assumée dans %1$s votre fuseau horaire local%2$s.";s:16:"TagUsageBenefits";s:487:"Une balise est un extrait de code qui peut être exécuté sur votre site. La plupart du temps, une balise peut être utilisée pour envoyer des données à un tier-partie (par exemple suivi de données) ou pour incorporer le contenu d\'un tier-partie sur votre site web (par exemple des gadgets de réseaux sociaux ou des enquêtes). Vous pouvez ajouter autant de balises que vous souhaitez et une balise sera exécutée dès lors que la condition d\'un déclencheur associé est remplie.";s:4:"Tags";s:7:"Balises";s:20:"TawkToTagDescription";s:80:"Tawk.to vous permets de suivre et discuter avec les visiteurs de votre site web.";s:13:"TawkToTagHelp";s:75:"Cette balise vous permet d\'ajouter le formulaire Tawk.to à votre site web.";s:24:"ThemeColorTagDescription";s:61:"Stylisez l\'interface utilisateurs des navigateurs supportés.";s:17:"ThemeColorTagHelp";s:94:"Cette balise support Chrome sur Android et d\'autres navigateurs qui comprennent \'theme-color\'.";s:17:"ThemeColorTagName";s:17:"Couleur du thème";s:32:"TimeSinceLoadVariableDescription";s:62:"Calcule le temps écoulé depuis que la page a été chargée.";s:25:"TimeSinceLoadVariableName";s:39:"Délais depuis le chargement de la page";s:23:"TimerTriggerDescription";s:74:"Déclenché à un interval spécifique, par exemple toutes les 3 secondes.";s:16:"TimerTriggerHelp";s:75:"Utilisez ce déclencheur pour effectuer une action de manière périodique.";s:16:"TimerTriggerName";s:12:"Chronomètre";s:7:"Trigger";s:12:"Déclencheur";s:18:"TriggerBeingUsedBy";s:66:"Le déclencheur est présentement utilisé aux endroits suivants :";s:27:"TriggerBeingUsedNeedsRemove";s:103:"Afin de supprimer ce déclencheur, veuillez en supprimer toutes les références et essayer à nouveau.";s:22:"TriggerCannotBeDeleted";s:39:"Ce déclencheur ne peut être supprimé";s:20:"TriggerConditionNode";s:483:"Note : certaines variables pourraient ne pas fonctionner comme vous le souhaitez. Par exemple en utilisant la variable clic en combinaison avec une variable de formulaire pourrait ne fonctionner que si vous avez ajouté un déclencheur de type clic à votre conteneur. Ceci s\'applique typiquement aux variables provenant des catégories Clics, Formulaires, Historique, Erreurs, Défilement et Visibilité qui devraient être utilisées avec leurs déclencheurs respectifs uniquement.";s:21:"TriggerConditionsHelp";s:324:"Vous pouvez restreindre encore plus le déclenchement de ce déclencheur en spécifiant une ou plusieurs conditions. Le déclencheur sera déclenché seulement quand toutes ces conditions seront rencontrées (pas quand une seule d\'entre-elles sera rencontrée). Déclencher uniquement quand ces conditions sont rencontrée :";s:15:"TriggerNameHelp";s:269:"Le nom du déclencheur vous permet de définir un nom unique qui vous permettre d\'identifier rapidemment le déclencheur. Veuillez noter que ce nom sera visible de manière publique dans le code source du déclencheur lorsque vous prévisualisez/déboguez ce conteneur.";s:20:"TriggerUsageBenefits";s:355:"Les déclencheurs vous permettent de définir à partir de quels évènements une balise devrait être exécutée ou bloquée. Par exemple lors d\'un clic sur un élément spécifique, ou quand le visiteur a atteint une position de défilement spécifique. De plus, vous pouvez définir un filtre afin d\'affiner le déclenchement d\'un certain déclencheur.";s:8:"Triggers";s:13:"Déclencheurs";s:4:"Type";s:4:"Type";s:5:"Types";s:5:"Types";s:9:"Unlimited";s:9:"Illimité";s:13:"UpdatePreview";s:35:"Mettre à jour la prévisualisation";s:8:"UpdatedX";s:57:"Fantastique ! Le/La%sa été mis(e) à jour avec succès.";s:12:"UpdatingData";s:28:"Mise à jour des données...";s:31:"UrlParameterVariableDescription";s:51:"Obtient la valeur d\'un paramètre d\'URL spécifique";s:24:"UrlParameterVariableName";s:16:"Paramètre d\'URL";s:22:"UrlVariableDescription";s:34:"Obtient l\'URL de la page courante.";s:15:"UrlVariableName";s:14:"Variable d\'URL";s:35:"UseCustomTemplateCapabilityRequired";s:137:"Ceci est un modèle personnalisé qui peut être créé ou modifié uniquement par un "Admin" ou un utilisateur avec la permission "%1$s"";s:28:"UserAgentVariableDescription";s:163:"Obtient la valeur de l\'agent d\'utilisateur qui indique le système d\'exploitation et les information du navigateur à propos du périphérique du visiteur courant.";s:21:"UserAgentVariableName";s:19:"Agent d\'utilisateur";s:26:"UtcDateVariableDescription";s:69:"La date courante en UTC, par exemple "Mon, 19 Mar 2018 14:00:00 GMT".";s:19:"UtcDateVariableName";s:8:"Date UTC";s:8:"Variable";s:8:"Variable";s:19:"VariableBeingUsedBy";s:63:"La variable est présentement utilisée aux endroits suivants :";s:28:"VariableBeingUsedNeedsRemove";s:99:"Pour supprimer cette variable, veuillez en supprimer toutes les références et essayer à nouveau.";s:23:"VariableCannotBeDeleted";s:39:"Cette variable ne peut être supprimée";s:16:"VariableNameHelp";s:223:"Le nom de la variable vous permet de définir un nom unique afin de l\'identifier rapidemment. Veuillez noter que ce sont de variable sera visible publiquement dans le code lorsque vous prévisualisez/déboguez ce conteneur.";s:21:"VariableUsageBenefits";s:309:"Les variables vous permettent d\'obtenir des données qui peuvent être utilisées par les balises et conteneurs. Le gestionnaire de balises Matomo possède un ensemble de variables prédéfinies que vous pouvez utiliser dès maintenant ainsi que des variables qui peuvent être configurées selon vos besoins.";s:9:"Variables";s:9:"Variables";s:7:"Version";s:7:"Version";s:8:"VersionX";s:10:"version %s";s:40:"VersionAlreadyPublishedToAllEnvironments";s:67:"Cette version ne peut être publiée vers aucun autre environnement";s:18:"VersionDescription";s:25:"Description de la version";s:22:"VersionDescriptionHelp";s:371:"Optionnellement, vous pouvez décrire cette nouvelle version avec plus de détails. Nous vous recommandons de mentionner ce que vous avez changé dans cette version. Par exemple que vous avez corrigé un problème particulier ou ajouté une nouvelle balise. Ceci vous aide à mieux comprendre chaque version si vous devez par exemple revenir à une version particulière.";s:22:"VersionEnvironmentHelp";s:535:"Afin d\'incorporer la version courante dans votre site web, vous devez publier la version vers un environnement, typiquement l\'environnement de "Production". Si vous avez un processus de révision spécifique, ou des environnement de test, vous pouvez publier cette version vers un environnement de "préproduction" ou de "test" avant de la déployer dans votre système de production afin de vous assurer que tout fonctionne comme attendu. Vous pouvez aussi publier cette version vers tout environnement et ce à n\'importe quel moment.";s:25:"VersionImportContentTitle";s:76:"Collez les données formattées en JSON que vous avez exportées auparavant.";s:17:"VersionImportInfo";s:244:"Quand vous importez la version d\'un conteneur, le brouillon courant sera écrasé. Pour exporter la version d\'un conteneur, cliquez sur "exporter" à côté d\'une version ou exportez la version brouillon courante depuis l\'écran des "Versions".";s:29:"VersionImportOverwriteContent";s:47:"Ecraser le brouillon courant avec cette version";s:20:"VersionImportSuccess";s:30:"Version importée avec succès";s:11:"VersionName";s:17:"Nom de la version";s:15:"VersionNameHelp";s:635:"Donnez un nom à cette version qui vous permettra de l\'identifier facilement. Vous pouvez utiliser la convention de nommage que vous souhaitez. Nous recommandons de suivre une convention telle que "1.0" au sein de laquelle vous augmentez le dernier chiffre lorsque vous effectuez des modifications mineurs telles que corriger une configuration, et le premier chiffre lorsque vous ajoutez une nouvelle balise par exemple. De cette manière vous pourrez facilement garder une trace de toutes vos versions. Veuillez noter que ce nom sera aussi disponible en tant que variable et donc visible publiquement dans le code source de la balise.";s:21:"VersionPublishSuccess";s:40:"La version a été publiée avec succès";s:15:"VersionRevision";s:23:"Révision de la version";s:20:"VersionUsageBenefits";s:691:"Les versions vous permettent de sauvegarder une copie de la configuration courante d\'un conteneur afin de pouvoir y revenir au besoin. Cela rend plus facile la correction d\'erreurs et vous permet de trouver facilement les balises, déclencheurs et variables déployés précédemment. Une fois que vous êtes satisfait(e) de votre configuration courante, vous pouvez la publier vers un environnement spécifique. Par exemple vous pourriez souhaiter de publier votre balise en premier lieu vers un environnement de "test" ou de "préproduction" afin de vous assurer que la configuration courant fonctionne avant de la mettre à disposition de tout le monde dans l\'environnement de production.";s:8:"Versions";s:8:"Versions";s:22:"ViewContainerDashboard";s:40:"Afficher le tableau de bord du conteneur";s:5:"ViewX";s:11:"Afficher %s";s:40:"VisibleElementClassesVariableDescription";s:131:"La valeur de tous les noms de classes CSS d\'un élément correspondant quand le déclencheur d\'élément visible s\'est déclenché.";s:33:"VisibleElementClassesVariableName";s:30:"Classes de l\'élément visible";s:35:"VisibleElementIdVariableDescription";s:116:"La valeur de l\'attribut ID d\'un élément correspondant quand le déclencheur d\'élément visible s\'est déclenché.";s:28:"VisibleElementIdVariableName";s:25:"ID de l\'élément Visible";s:41:"VisibleElementNodeNameVariableDescription";s:132:"La valeur du nom de l\'élément correspondant quand le déclencheur d\'élément visible s\'est déclenché. Par exemple "P" ou "DIV".";s:34:"VisibleElementNodeNameVariableName";s:35:"Nom du nœud de l\'élément visible";s:37:"VisibleElementTextVariableDescription";s:108:"La valeur du texte de l\'élément correspondant quand le déclencheur d\'élément visible s\'est déclenché.";s:30:"VisibleElementTextVariableName";s:28:"Texte de l\'élément visible";s:36:"VisibleElementUrlVariableDescription";s:118:"La valeur du lien URL (href) de l\'élément correspondant quand le déclencheur d\'élément visible s\'est déclenché.";s:29:"VisibleElementUrlVariableName";s:41:"URL de destination de l\'élément visible";s:36:"VisualWebsiteOptimizerTagDescription";s:106:"L\'optimisateur de site web visuel est une solution tout-en-un de test A/B et d\'optimisation de conversion.";s:29:"VisualWebsiteOptimizerTagHelp";s:76:"Cette balise ajoute le code intelligent et asynchrone VWO à votre site web.";s:29:"VisualWebsiteOptimizerTagName";s:31:"Optimisateur de site web visuel";s:35:"WantToDeployThisChangeCreateVersion";s:89:"Souhaitez-vous déployer ce changement ? %1$sPubliez une nouvelle version maintenant%2$s.";s:26:"WeekdayVariableDescription";s:65:"Retourne le jour local de la semaine ex lundi, mardi, mercredi...";s:19:"WeekdayVariableName";s:18:"Jour de la semaine";s:29:"WindowLeaveTriggerDescription";s:130:"Déclenché lorsque l\'utilisateur est sur le point de quitter la page courante en déplaçant le curseur en dehors de la fenêtre.";s:22:"WindowLeaveTriggerHelp";s:532:"Ce déclencheur est déclenché quand l\'utilisateur est potentiellement sur le point de quitter le site web et bouge sa souris en dehors de la page courante par exemple vers la barre d\'adresse ou n\'importe quel autre bouton. Ceci peut être utile afin de garder votre visiteur (euse) engagé et de ne pas le/la perdre par exemple en lui affichant un dialogue de sortie. Vous pourriez aussi être intéressé(e) par le déclencheur "fenêtre quittée" qui est déclencher dès lors que l\'utilisateur-trice a quitté la page courante.";s:22:"WindowLeaveTriggerName";s:17:"Fenêtre quittée";s:30:"WindowLoadedTriggerDescription";s:79:"Déclenché lorsque la page est complétement chargée incluant les images etc.";s:23:"WindowLoadedTriggerHelp";s:266:"Cette étape de chargement de la page web est quand la page est complétement chargée d\'après le navigateur. Dans la plupart des cas cela signifie que les images sont chargée, les styles appliqués etc. Ce déclencheur est toujours déclenché après "DOM Ready".";s:23:"WindowLoadedTriggerName";s:17:"Fenêtre chargée";s:30:"WindowUnloadTriggerDescription";s:127:"Déclenché juste avant que la fenêtre du navigateur soit fermée ou bien que l\'utilisateur navigue vers une page différente.";s:23:"WindowUnloadTriggerHelp";s:298:"Ce déclencheur identifie un utilisateur qui ferme la page courante par opposition au déclencheur "sortie de page" qui se déclencheur lorsqu\'un utilisateur est sur le point de quitter votre page. Soit en navigant vers une autre page avec le même onglet ou bien en fermant complètement l\'onglet.";s:23:"WindowUnloadTriggerName";s:20:"Fenêtre déchargée";s:25:"ZendeskChatTagDescription";s:85:"Atteignez vos clients de manière instantanée via le web, téléphone et messagerie.";s:18:"ZendeskChatTagHelp";s:102:"Cette balise vous permet d\'ajouter le formulaire de discussion instantanée Zendesk à votre site web.";s:18:"ZendeskChatTagName";s:52:"Discussion instantanée Zendesk (anciennement Zopim)";}s:4:"Tour";a:51:{s:17:"PluginDescription";s:104:"Devenez un Expert Matomo en un clin d\'oeuil en complètant des exercices qui vous habitueront à Matomo.";s:4:"Tour";s:14:"Visite guidée";s:10:"Engagement";s:10:"Engagement";s:10:"UploadLogo";s:23:"Téléverser votre logo";s:7:"AddUser";s:22:"Ajouter un utilisateur";s:10:"AddWebsite";s:25:"Ajouter un autre site web";s:9:"AddReport";s:28:"Ajouter un rapport planifié";s:10:"AddSegment";s:18:"Ajouter un segment";s:13:"AddAnnotation";s:22:"Ajouter une annotation";s:17:"BrowseMarketplace";s:20:"Parcourir le marché";s:18:"PreviousChallenges";s:22:"Exercices précédents";s:14:"NextChallenges";s:19:"Prochains exercices";s:12:"RowEvolution";s:21:"Evolution de la ligne";s:5:"ViewX";s:11:"Afficher %s";s:6:"SetupX";s:14:"Paramétrer %s";s:15:"SelectDateRange";s:32:"Sélectionnez une plage de dates";s:26:"SelectDateRangeDescription";s:51:"Sélectionnez une plage de date avec le calendrier.";s:19:"ChangeVisualisation";s:24:"Changer la visualisation";s:30:"ChangeVisualisationDescription";s:152:"Affichez un rapport et sélectionnez l\'icône de visualisation en bas du rapport afin de d\'afficher le même rapport avec une visualisation différente.";s:14:"FlattenActions";s:26:"Aplatir un rapport de page";s:25:"FlattenActionsDescription";s:194:"Rendez-vous à Comportement => Page et cliquez en bas du rapport sur l\'icône de roue dentée afin d\'aplatir le rapport. Un rapport aplati change la hiérachie d\'un rapport groupé à une liste.";s:27:"ViewRowEvolutionDescription";s:123:"L\'evolution de la ligne vous affiche la donnée courante et passée d\'une métrique pour m\'importe quelle ligne du rapport.";s:24:"ViewVisitsLogDescription";s:132:"Le journal des visites vous montre toutes les visites individuelles et les actions que chaque visiteur a effectuées sur votre site.";s:29:"ViewVisitorProfileDescription";s:152:"Le journal des visiteurs vous permet de comprendre le comportement individuel de vos visiteurs en résummant et en listant les visites de vos visiteurs.";s:27:"ShareAllChallengesCompleted";s:90:"Vous venez de débloquer la réussite %1$s en complétant l\'ensemble des exercices Matomo.";s:18:"ChallengeCompleted";s:48:"Félicitations, vous avez terminé cet exercice.";s:18:"BecomeMatomoExpert";s:30:"Devenez un(e) Expert(e) Matomo";s:24:"YouCanCallYourselfExpert";s:82:"Vous pouvez maintenant dire que vous êtes un(e) vrai(e) %1$sExpert(e) Matomo%2$s.";s:11:"StatusLevel";s:96:"Vous êtes un(e) %1$s. Complétez %2$s exercices supplémentaires et vous deviendrez un(e) %3$s.";s:31:"ConfigureGeolocationDescription";s:75:"Assurez vous que l\'emplacement de vos visiteurs est détecté correctement.";s:23:"DisableBrowserArchiving";s:74:"Désactiver l\'archivage via le navigateur pour améliorer les performances";s:17:"SkipThisChallenge";s:17:"Passer l\'exercice";s:22:"ShareYourAchievementOn";s:39:"Partagez vos accomplissements sur %1$s.";s:14:"MatomoBeginner";s:19:"Débutant(e) Matomo";s:18:"MatomoIntermediate";s:21:"Intermédiaire Matomo";s:12:"MatomoTalent";s:13:"Talent Matomo";s:18:"MatomoProfessional";s:20:"Professionnel Matomo";s:12:"MatomoExpert";s:13:"Export Matomo";s:20:"ConfigureGeolocation";s:31:"Configurer la géo-localisation";s:18:"CustomiseDashboard";s:32:"Personnaliser le tableau de bord";s:29:"CustomiseDashboardDescription";s:141:"Vous pouvez ajouter de nouveaux gadgets sur votre tableau de bord, cela permettra au rapport de contenir les métriques les plus importantes.";s:10:"DefineGoal";s:19:"Ajouter un objectif";s:21:"DefineGoalDescription";s:296:"Le suivi des conversions est une bonne manière d\'identifier si vous êtes en train d\'atteindre vos objectifs commerciaux ou non, d\'identifier de nouveaux objectifs, de voir et analyser votre performance, et d\'apprendre comment augmenter vos conversions, taux de conversions et revenu par visite.";s:17:"EmbedTrackingCode";s:23:"Code de suivi embarqué";s:15:"CompletionTitle";s:7:"Bravo !";s:17:"CompletionMessage";s:74:"Vous avez complété tous les exercices. Donnez vous une tape dans le dos.";s:10:"Part1Title";s:99:"Bienvenue à Matomo %1$s. Ce gadget vous aide à devenir un(e) Expert(e) Matomo en un clin d\'oeuil.";s:10:"Part2Title";s:88:"Continuez comme cela %1$s! Vous êtes en bon chemin pour devenir un(e) expert(e) Matomo.";s:10:"Part3Title";s:95:"Beau progrès %1$s! Si vous continuez comme cela, vous serez un(e) expert(e) dans peu de temps!";s:10:"Part4Title";s:71:"Beau progrès %1$s ! Il reste seulement quelques exercices à terminer.";s:22:"OnlyVisibleToSuperUser";s:74:"Seulement vous en tant que %1$ssuper utilisateur%2$spouvez voir ce gadget.";}s:11:"Transitions";a:34:{s:13:"BouncesInline";s:10:"%s rebonds";s:13:"DirectEntries";s:17:"Entrées directes";s:11:"Transitions";s:11:"Transitions";s:9:"ErrorBack";s:31:"Retour à l\'action précédente";s:11:"ExitsInline";s:10:"%s sorties";s:12:"NumPageviews";s:13:"%s pages vues";s:12:"NumDownloads";s:20:"%s téléchargements";s:11:"NumOutlinks";s:16:"%s liens sortant";s:4:"TopX";s:22:"Top %s des étiquettes";s:18:"FeatureDescription";s:228:"Transitions vous donne un rapport qui montre ce que vos visiteurs ont fait directement avant et après avoir vu une certaine page. Cette page explique comment accéder, comprendre et utiliser la puissance du rapport Transitions.";s:23:"AvailableInOtherReports";s:118:"Le saviez-vous ? Les transitions sont également disponibles sous forme d\'action en ligne dans les rapports suivants :";s:24:"AvailableInOtherReports2";s:117:"Il suffit de survoler une ligne dans l\'un de ces rapports et de cliquer sur l\'icône de transition %s pour le lancer.";s:13:"FromCampaigns";s:20:"Depuis les campagnes";s:17:"FromPreviousPages";s:25:"Depuis des pages internes";s:23:"FromPreviousPagesInline";s:28:"%s depuis des pages internes";s:24:"FromPreviousSiteSearches";s:30:"Depuis des recherches internes";s:30:"FromPreviousSiteSearchesInline";s:33:"%s depuis des recherches internes";s:17:"FromSearchEngines";s:31:"Depuis des moteurs de recherche";s:18:"FromSocialNetworks";s:19:"De Réseaux Sociaux";s:12:"FromWebsites";s:20:"Depuis des sites web";s:15:"IncomingTraffic";s:14:"Trafic entrant";s:11:"LoopsInline";s:25:"%s rechargements de pages";s:15:"NoDataForAction";s:32:"Il n\'y a aucune données pour %s";s:22:"NoDataForActionDetails";s:86:"L\'action n\'a eu aucune visite de page durant la période %s ou bien elle est invalide.";s:15:"OutgoingTraffic";s:14:"Trafic sortant";s:17:"PluginDescription";s:182:"Rapporte les actions précédentes et suivantes pour chacune des URL\'s de page dans un nouveau rapport de Transitions, disponible depuis le rapports des Actions via un nouvel icône.";s:19:"ShareOfAllPageviews";s:61:"Cette page a eu %1$s affichages (%2$s de tous les affichages)";s:16:"ToFollowingPages";s:23:"Vers des pages internes";s:22:"ToFollowingPagesInline";s:26:"%s vers des pages internes";s:23:"ToFollowingSiteSearches";s:19:"Recherches internes";s:29:"ToFollowingSiteSearchesInline";s:22:"%s recherches internes";s:15:"XOfAllPageviews";s:27:"%s de toutes les pages vues";s:13:"XOutOfYVisits";s:14:"%1$s (de %2$s)";s:18:"PageURLTransitions";s:25:"Transitions d\'URL de page";}s:13:"TwoFactorAuth";a:45:{s:23:"TwoFactorAuthentication";s:33:"Authentification à deux facteurs";s:10:"TwoFAShort";s:3:"2FA";s:28:"TwoFactorAuthenticationIntro";s:605:"%1$sL\'authentification deux-facteurs%2$s améliore la sécurité de votre compte en ajoutant une couche supplémentaire de vérification quand vous vous connectez. Chaque fois que vous vous connectez, il vous sera non-seulement demandé de fournir votre identifiant et mot de passe, mais aussi un code d\'authentification qui changera périodiquement et est généré depuis votre périphérique mobile. Ceci veut dire que même si quelqu\'un connait votre identifiant et mot de passe, cette peronne ne sera pas capable de se connecter à moins qu\'elle ait accès à votre périphérique mobile par exemple.";s:32:"TwoFactorAuthenticationIsEnabled";s:59:"L\'authentification deux facteurs est actuellement activée.";s:33:"TwoFactorAuthenticationIsDisabled";s:63:"L\'authentification deux facteurs est actuellement désactivée.";s:31:"TwoFactorAuthenticationRequired";s:101:"L\'authentification à deux facteur est requise pour tout le monde, vous ne pouvez pas la désactiver.";s:24:"ConfigureDifferentDevice";s:39:"Configurer un périphérique différent";s:28:"SetUpTwoFactorAuthentication";s:52:"Configurer l\'authentification à deux facteurs (2FA)";s:38:"RequiredToSetUpTwoFactorAuthentication";s:87:"Vous devez configurer l\'authentification deux facteurs avant de pouvoir vous identifier";s:18:"AuthenticationCode";s:23:"Code d\'authentification";s:6:"Verify";s:9:"Vérifier";s:5:"StepX";s:9:"Étape %s";s:18:"MissingAuthCodeAPI";s:61:"Veuillez spécifier un code d\'authentification deux-facteurs.";s:15:"InvalidAuthCode";s:55:"Le code d\'authentification deux facteurs est incorrect.";s:32:"RequiredAuthCodeNotConfiguredAPI";s:101:"Vous devez configurer l\'authentification à deux facteurs. Veuillez vous connectez avec votre compte.";s:25:"VerifyIdentifyExplanation";s:152:"Ouvrez l\'application d\'authentification à deux facteurs sur votre périphérique pour afficher le code d\'authentification et vérifier votre identité.";s:24:"DontHaveYourMobileDevice";s:45:"Vous n\'avez pas votre périphérique mobile ?";s:24:"EnterRecoveryCodeInstead";s:40:"Entrez un de vos codes de récupération";s:35:"AskSuperUserResetAuthenticationCode";s:83:"Demandez à votre super utilisateur de réinitialiser votre code d\'authentification";s:21:"SetupIntroFollowSteps";s:90:"Veuillez suivre les étapes suivantes afin de configurer l\'authentification deux-facteurs:";s:18:"SetupFinishedTitle";s:62:"Félicitations ! Votre compte est maintenant mieux sécurisé.";s:21:"SetupFinishedSubtitle";s:260:"Vous avez configuré l\'authentification à deux facteurs avec succès. La prochaine fois que vous vous connecterez, vous aurez aussi besoin d\'un code d\'authentification. Assurez-vous d\'avoir votre périphérique mobile ou vos codes de récupération avec vous.";s:31:"WarningChangingConfiguredDevice";s:156:"Vous êtes sur le point de modifier le dispositif d\'authentification à deux facteurs configuré. Ceci invalidera tout dispositif précédemment configuré.";s:17:"ShowRecoveryCodes";s:36:"Afficher les codes de récupération";s:12:"ConfirmSetup";s:26:"Confirmer la configuration";s:18:"NotPossibleToLogIn";s:44:"Impossible de s\'identifier auprès de Matomo";s:24:"LostAuthenticationDevice";s:298:"Bonjour, %1$s J\'ai activé l\'authentification à deux facteurs et perdu mon périphérique d\'authentification. Pourriez-vous réinitialiser l\'authentification à deux facteurs pour mon usager %5$s ? Vous pouvez trouver les intructions pour le faire ici : %6$s. %2$sL\'URL Matomo est %3$s. %4$s Merci";s:21:"WrongAuthCodeTryAgain";s:62:"Code d\'authentification entré incorrect. Veuillez réessayer.";s:12:"DisableTwoFA";s:47:"Désactiver l\'authentification à deux facteurs";s:11:"EnableTwoFA";s:43:"Activer l\'authentification à deux facteurs";s:19:"ConfirmDisableTwoFA";s:180:"Êtes-vous sûr(e) de vouloir désactiver l\'authentification à deux facteurs pour votre compte ? Avoir l\'authentification à deux facteurs améliore la sécurité de votre compte.";s:19:"VerifyAuthCodeIntro";s:168:"Veuillez entrer le code à six chiffres de votre application d\'authentification ci-dessous afin de confirmer que vous avez configuré avec succès votre périphérique.";s:18:"VerifyAuthCodeHelp";s:117:"Veuillez entre le code à six chiffres qui a été généré sur votre périphérique moible en scannant le code bar.";s:17:"Your2FaAuthSecret";s:45:"Votre secret d\'authentification deux facteurs";s:26:"SetupAuthenticatorOnDevice";s:54:"Configurer l\'authentificateur sur votre périphérique";s:31:"SetupAuthenticatorOnDeviceStep1";s:59:"Installez une application d\'authentification, par exemple :";s:31:"SetupAuthenticatorOnDeviceStep2";s:198:"Ensuite, ouvrez l\'application et scannez le code bar ci-dessous avec l\'application d\'authentification à deux facteurs. Si vous ne pouvez pas scanner le code bar, %1$sentrez ce code%2$s à la place.";s:24:"SetupBackupRecoveryCodes";s:162:"Veuillez sauvegarder vos codes de récupération en utilisant une des méthodes ci-dessus avant de continuer la configuration de l\'authentification deux-facteurs.";s:13:"RecoveryCodes";s:23:"Codes de récupération";s:24:"RecoveryCodesExplanation";s:215:"Vous pouvez utiliser des codes de récupération pour accéder à votre comptre quand vous ne pouvez pas recevoir de codes d\'authentification, par exemple quand vous n\'avez pas votre périphérique mobile avec vous.";s:21:"RecoveryCodesSecurity";s:137:"Veuillez traiter les codes de récupération avec le même niveau de sécurité que vous le feriez pour un mot de passe s\'il-vous-plait !";s:20:"RecoveryCodesAllUsed";s:108:"Tous les codes de récupération ont été utilisé, il est vivement recommandé d\'en générer de nouveaux.";s:24:"RecoveryCodesRegenerated";s:122:"Les cods de récupération ont été généré. Assurez-vous de télécharger et d\'imprimer les nouveaux codes générés.";s:24:"GenerateNewRecoveryCodes";s:45:"Générer de nouveaux codes de récupération";s:28:"GenerateNewRecoveryCodesInfo";s:157:"Lorsque vous générez de nouveaux codes de récupération, les anciens ne fonctionneront plus. Assurez-vous de télécharger et imprimer vos nouveaux codes.";}s:11:"UserCountry";a:43:{s:21:"CannotLocalizeLocalIP";s:60:"L\'adresse IP %s est locale et ne peut être géo-localisée.";s:4:"City";s:5:"Ville";s:14:"CityAndCountry";s:10:"%1$s, %2$s";s:9:"Continent";s:9:"Continent";s:10:"Continents";s:10:"Continents";s:7:"Country";s:4:"Pays";s:11:"CountryCode";s:9:"Code pays";s:10:"country_a1";s:13:"Proxy anonyme";s:10:"country_a2";s:21:"Fournisseur satellite";s:11:"country_cat";s:31:"Communautés de langue Catalane";s:10:"country_o1";s:10:"Autre pays";s:13:"VisitLocation";s:24:"Emplacement de la visite";s:20:"CurrentLocationIntro";s:53:"D\'après ce fournisseur, votre emplacement actuel est";s:28:"DefaultLocationProviderDesc1";s:118:"Le fournisseur de localisation par défaut devine le pays d\'un visiteur en se basant sur le langage de son navigateur.";s:28:"DefaultLocationProviderDesc2";s:144:"Ceci n\'est pas très précis, %1$snous recommandons donc l\'installation et l\'utilisation d\'une %2$sbase de données de géolocalisation%3$s.%4$s";s:34:"DefaultLocationProviderExplanation";s:271:"Vous utilisez le fournisseur de localisation par défaut, ce qui signifie que Matomo va tenter de déterminer la localisation du visiteur en se basant sur la langue qu\'ils utilisent. %1$sConsultez ceci%2$s pour apprendre comment configurer une localisation plus précise.";s:17:"DistinctCountries";s:19:"%s pays différents";s:19:"FromDifferentCities";s:19:"villes différentes";s:24:"GeoIPDocumentationSuffix";s:285:"Afin de visualiser les données de ce rapport, vous devez installer GeoIP depuis l\'onglet d\'administration Géolocalisation. Les bases de données commerciales %1$sMaxmind%2$s sont plus précises que les gratuites. Pour voir à quelles points elles sont précises, cliquez %3$sici%4$s.";s:11:"Geolocation";s:16:"Géolocalisation";s:19:"GeolocationPageDesc";s:100:"Sur cette page vous pouvez changer la manière dont Matomo détermine la localisation des visiteurs.";s:20:"getCityDocumentation";s:100:"Ce rapport montre dans quelle ville vos visiteurs étaient quand ils ont accédé à votre site web.";s:25:"getContinentDocumentation";s:102:"Ce rapport montre dans quel continent vos visiteurs étaient quand ils ont accédé à votre site web.";s:2